INSERT INTO `about_us` VALUES (1,'ABOUT LION ROARING PMA','about-us/zK2e1gXK2rXH1VOIkVkzPSnGCI15SgED9pvSeX06.jpg','<h3>About Lion Roaring PMA</h3><p><strong>The Lion Roaring PMA is created by the Lord Jesus through the revelation of Daud and Lystia Santosa, and it is committed to do the work that God has revealed for the ministry‚Äôs plan since 2018. The Lord revealed the Lion Roaring vision to Lystia and Daud Santosa from June 5-7, 2018, in Bethany Beach, Delaware. The vision that Daud received is ‚Äúa Habitation where Supernatural and Solution intersects‚Äù for the next seven years and the verse that associated with this vision is ‚Äú‚ÄúThen he said to me, ‚ÄúProphesy to these bones and say to them, ‚ÄòDry bones, hear the word of the Lord! This is what the Sovereign Lord says to these bones: I will make breath[a] enter you, and you will come to life. I will attach tendons to you and make flesh come upon you and cover you with skin; I will put breath in you, and you will come to life. Then you will know that I am the Lord.‚Äô‚Äù ‚Äì Ezekiel 37:4-6. At first, Daud and Lystia did not have a complete understanding of this vision. Over the last two years, the Holy Spirit has begun revealing all the pieces of the puzzle and began connecting the people who will be a part of this vision.&nbsp;</strong></p><h3>Mission</h3><p><strong>Our mission is to bring Heaven‚Äôs cultures on earth and to restore nations (communities, cities, states, and countries) through each soul whom the Lord has transformed and chosen. This soul will be given the opportunity to work for the Lion Roaring Innovation Centers &amp; its partners after being fully educated through Lion Roaring Foundation as God‚Äôs king and priest. The goal for each soul is to create inspired ideas and become self-sufficient to perform good works and bring heaven‚Äôs attributes into its environment.</strong></p><p><i><strong>‚ÄúStrive to become quite healthy spiritually, eradicate all the rust of spiritual sickness and our body will transform to better envelopment (wrap completely) to be spiritual soil where love is the fertilizer, humility and love for the fellowman being the earth.‚Äù</strong></i></p><p><strong>‚ÄúTo travel the pathways of life, it is necessary to know beforehand the path that your conscience outlines, whose spiritual law proceeds (earning) from the Divine Spirit.‚Äù</strong><br><strong>(John 14:15-21, Roman 9:1)</strong></p><p><strong>Revelation 5:10 ‚ÄúAnd have made us to our God kings and priests: and we shall reign on the earth.‚Äù</strong></p><p><strong>Isaiah 46:10 ‚ÄúDeclaring the end from the beginning, and from ancient times the things that are not yet done, saying, My counsel shall stand, and I will do all my pleasure:‚Äù</strong></p><p><strong>Rev 17:17 ‚ÄúFor God has put in their hearts to fulfill his will, and to agree, and give their kingdom to the beast(world), until the words of God shall be fulfilled.‚Äú</strong></p><p><strong>Roman 14:17 ‚ÄúFor the kingdom of God is not meat and drink; but righteousness, and peace, and joy in the Holy Ghost. For he that in these things serves Christ is acceptable to God, and approved of men.‚Äù</strong></p><p><strong>Daniel 2:44 ‚ÄúAnd in the days of these kings shall the God of heaven set up a kingdom, which shall never be destroyed: and the kingdom shall not be left to other people, but it shall break in pieces and consume all these kingdoms, and it shall stand for ever.‚Äù</strong></p><p><strong>Ephesians 1:18:19 ‚ÄúThe eyes of your understanding being enlightened; that you may know what is the hope of his calling, and what the riches of the glory of his inheritance in the saints, And what is the exceeding greatness of his power to us-ward who believe, according to the working of his mighty power, ‚Äù</strong></p><h4>‚ÄúThe kingdom of God is within you. It means the full knowledge and observance of the will of God within you. &nbsp;God‚Äôs eternal love in its fullness the living word in the heart of man with the&nbsp;<i>infinite wisdom</i>&nbsp;itself in this&nbsp;<i>living word (union with Christ), This is a</i>&nbsp;vessel for the love of God, a vessel full of meekness and humility, then such a heart holds the full truth (divine truth). Faith with deed that produces rivers of living water (fruitful of eternal life). Our life must show that the living water is within us. We are the<i><strong>&nbsp;Chosen one who&nbsp;</strong></i>has listened to His teaching, believe and&nbsp;<i>act according</i>&nbsp;with what they the Lord Jesus has taught them and to transform nation and teach the kingdom of the gospel by discipling and restoring society based on the Kingdom culture.‚Äù</h4>','ABOUT LION ROARING PMA','The Lion Roaring PMA is created by the Lord Jesus through the revelation of Daud and Lystia Santosa','The Lion Roaring PMA is created by the Lord Jesus through the revelation of Daud and Lystia Santosa','2024-03-07 01:39:35','2024-10-18 18:27:59');
