INSERT INTO `bulletins` VALUES (17,50,'Lion Roaring Digital network (LRDnet) release 1.0','Welcome to Lion Roaring  Digital  Network (LRDnet) 1.0. This is pre-production release of LionDnet.  This is the future of digital ministry where everyone can learn and networking from man and women of God.  Habakkuk 2:1-3 \"I will stand upon my watch, and set me upon the tower, and will look forth to see what he will speak with me, and what I shall answer concerning my complaint. And Jehovah answered me, and said, Write the vision, and make it plain upon tablets, that he may run that readeth it. For the vision is yet for the appointed time, and it hasteth toward the end, and shall not lie: though it tarry, wait for it; because it will surely come, it will not delay. Behold, his soul is puffed up, it is not upright in him; but the righteous shall live by his faith.‚Äù This is the vision that God gave my wive and I  in 2017 and it came to past in 2014.  Welcome to  Lion Roaring Digital Community Network (LRDnet) and the future belong to our Lord Jesus.','2024-08-21 23:51:09','2024-08-22 09:19:36'),(18,50,'Announcememt, August 26, 2024','For All members,\r\nAs of now, All our communications, meetings, messaging, materials, etc will be conducted in LRDnet.  I would encourage all members to use this tool so we don\'t have any missing information.  Everyone will be in the same page. Thank you.','2024-08-26 01:45:13','2024-08-26 09:37:56'),(28,50,'Colosians 2:18','\"Do not let anyone who delights in false humility and the worship of angels disqualify you with speculation about what he has seen. Such a person is puffed up without basis by his unspiritual mind.\"','2024-08-29 15:14:43','2024-08-29 15:14:43'),(29,58,'trabajo ministerial y comunidad Localidad los Zapallos ( sanata fe )','bendiciones amados les saludo desde Argentina en el d√≠a de la fecha estamos llevando la palabra de DIOS y ayuda de alientos ,ropa a la localidad de los Zapallos de la ciudad de santa fe donde coocurren adultos y ni√±os de todas las edades en ele d√≠a de la fecha 4 personas mas se entregaron al SE√ëOR alabado sea su nombre..!!! sirviendo en e Reino con mi esposa e hijos Proverbio 4;23','2024-08-29 16:51:12','2024-08-29 16:51:12'),(31,50,'Visions','\"Visions are powerful tools because they allow us to tap into the deeper realms beyond our physical consciousness. For this to happen you must purge yourself of all forms of uncleanliness, especially covetousness and lies.‚Äù\r\n‚ÄúLas visiones son herramientas poderosas porque nos permiten acceder a los reinos m√°s profundos que se encuentran m√°s all√° de nuestra conciencia f√≠sica. Para que esto suceda, debes purificarte de todas las formas de impureza, especialmente la codicia y las mentiras‚Äù.','2024-08-31 23:58:14','2024-08-31 23:58:14'),(33,58,'Temperamento  y  Car√°cter','El temperamento se refiere a la personalidad natural o disposici√≥n de una persona que influye en su comportamiento y reacciones. \r\n Es la forma en que una persona  responde a diferentes situaciones y est√≠mulos\r\n2. G√°latas 5:22-23: \"El  fruto del Esp√≠ritu es amor, gozo, paz, paciencia, benignidad, bondad, fe, mansedumbre, templanza\".\r\nEl car√°cter es el conjunto de caracter√≠sticas morales, √©ticas y comportamentales que definen a una persona y gu√≠an su comportamiento y decisiones. Incluye aspectos como:\r\nValores y principios: Creencias y convicciones que orientan su comportamiento.\r\n\"El que es fiel en lo poco, tambi√©n es fiel en lo mucho\" (Lucas 16:10). La fidelidad y la integridad son fundamentales para un buen car√°cter.\r\nSaludos ...!!!!','2024-09-03 16:51:50','2024-09-03 16:51:50'),(34,50,'From Johnn Anosike - THE IMPACT OF THE \'MBER\' MONTHS','From September onwards, the months have something in common; they all end with \"mber\".\r\nSuch a time in the calendar is critical in the spirit.\r\nThese are times when occult men start to renew their covenants with blood to enter into their new\r\nyear. Sons of God, this is not a time to extinguish your fire, or to be sluggish in spirit. This is not the time to decrease in your spiritual life.\r\nThis is the time to pick up your battle axe and war to gain victories. This is your time to roar, this is your time to add more jewels on your crown in heaven. This is your time to prosper!\r\nThe onus is on you to ensure that your blood and that of your family is not shed in these end-of-year times. You, through your commitment to spiritual warfare, are the one to decide whether you will see the end of this year.','2024-09-04 07:39:16','2024-09-07 15:13:47'),(35,50,'From John Anosike - EL IMPACTO DE LOS MESES \'MBER\'','A partir de septiembre, los meses tienen algo en com√∫n: todos terminan en \"mber\". Este momento del calendario es cr√≠tico para el esp√≠ritu. Son tiempos en los que los hombres ocultistas comienzan a renovar sus pactos con sangre para entrar en su nuevo a√±o. Hijos de Dios, este no es el momento de apagar su fuego ni de ser perezosos en esp√≠ritu. Este no es el momento de disminuir su vida espiritual. Este es el momento de tomar su hacha de guerra y luchar para obtener victorias. Este es su momento de rugir, este es su momento de agregar m√°s joyas a su corona en el cielo. ¬°Este es su momento de prosperar! La responsabilidad de garantizar que su sangre y la de su familia no se derramen en estos tiempos de fin de a√±o recae sobre ustedes. Ustedes, a trav√©s de su compromiso con la guerra espiritual, son los que deben decidir si ver√°n el final de este a√±o.','2024-09-04 07:41:33','2024-09-04 07:41:33'),(38,58,'Qu√© tienes en tu mano','En √âxodo 4:2-4, Dios le dijo a Mois√©s: \"¬øQu√© tienes en tu mano?\"\r\n\r\n. Mois√©s respondi√≥: \"Un cayado\". Entonces, Dios le dijo: \"Arr√≥jalo al suelo\". Mois√©s lo arroj√≥, y el cayado se convirti√≥ en una serpiente. Luego, Dios le dijo a Mois√©s: \"Extiende tu mano y agarra la serpiente por la cola\". Mois√©s lo hizo, y la serpiente se convirti√≥ nuevamente en un cayado.\r\nrecuerda que Dios puede tomar lo que tenemos, no importa cu√°n ordinario o insignificante parezca, y usarlo para hacer algo extraordinario.\r\n Tenemos que reconocer que la vida cristiana no se trata de lo que har√≠amos si tuvi√©ramos,\r\n Es decir, no se trata de lo que NO TENEMOS\r\n Si no preguntarnos ¬øQU√â ESTAMOS HACIENDO CON LO QUE S√ç TENEMOS? \r\n muchas veces nuestras circunstancias son un reflejo de lo que le estamos dando a nuestro Dios','2024-09-05 19:03:45','2024-09-05 19:03:45'),(39,50,'Prophetic Message from Anosike','‚ÄúRun with what God has asked you to do, not with what is popular. You cannot achieve this if you are available everywhere. Wilderness life, loneliness is your greatest asset to carry the fire of God. There is no fire in popular opinion. As a matter of fact, the fastest way to lose your fire is to ride on the frequency of what is popular. Ministry is not you, Ministry is God\'s will. When you are alone, God shows you what to do, God shows you what to preach, God tells you, this is your assignment. You can see that fire will guarantee divine direction which makes mistakes impossible. Fire will put you on a no mistake dimension for your ministry.‚Äù\r\n‚ÄúA time is coming, whether you are Elohims or you are in the heavenly realms or you are beneath the earth or you are on earth, If your existence is not captured within the frequencies and electricity and the glory of this fellowship, you will be extinct.\"','2024-09-07 15:16:21','2024-09-07 15:16:21'),(40,50,'Mensaje prof√©tico de John Anosike','‚ÄúCorran con lo que Dios les ha pedido que hagan, no con lo que es popular. No pueden lograr esto si est√°n disponibles en todas partes. La vida en el desierto, la soledad es su mayor activo para llevar el fuego de Dios. No hay fuego en la opini√≥n popular. De hecho, la forma m√°s r√°pida de perder su fuego es viajar en la frecuencia de lo que es popular. El ministerio no es usted, el ministerio es la voluntad de Dios. Cuando est√°n solos, Dios les muestra qu√© hacer, Dios les muestra qu√© predicar, Dios les dice que esta es su tarea. Pueden ver que el fuego garantizar√° la direcci√≥n divina que hace que los errores sean imposibles. El fuego los pondr√° en una dimensi√≥n sin errores para su ministerio‚Äù.\r\n‚ÄúLlegar√° un momento, ya sea que sean Elohim o est√©n en los reinos celestiales o est√©n debajo de la tierra o est√©n en la tierra, si su existencia no est√° capturada dentro de las frecuencias y la electricidad y la gloria de esta comunidad, se extinguir√°n‚Äù.','2024-09-07 15:18:00','2024-09-07 15:18:00'),(41,58,'Argentina santa Fe','Blessings..|| I tell you, brothers, this past Thursday in the town of Arroyos Leyes of the CITY OF SANTA FE, lives were given to the Lord Jesus, we were able to deliver merchandise thanks to the financial support that LION ROARNG gives us, it is wonderful what the Lord is doing in that community Glory to GOD We love you in the LORD greetings.!! Pablo and Adriana Chia','2024-09-07 16:08:25','2024-09-07 16:08:25'),(42,58,'EL ROPERO DEL HOMRE','EL ROPERO DEL HOMBRE\r\n\r\nLa forma en que vestimos tiene que ver mucho con nuestra vida. \r\n\r\nDe hecho, cuando vemos la vestimenta de una persona, podemos sacar conclusiones.\r\n\r\nDime c√≥mo vistes y te dir√© qui√©n eres\r\n\r\n\r\nLa vestimenta es algo muy apreciado para muchas personas, sus gusto su modas\r\n\r\nEn el af√°n de estar al d√≠a gastan lo necesario para ello, y hasta lo que no tienen,\r\n\r\n sin saber que quiz√°s alg√∫n d√≠a el suceso imprevisto puede tocar nuestro ropero y lo que hab√≠amos valoramos tanto tiempo, en una hora o d√≠a quedo en nada, \r\n\r\n dice la Biblia\r\n\r\nüìë Vi todas las obras que se hab√≠an hecho bajo el sol, y, ¬°mira!, todo era vanidad y un esforzarse tras viento.\r\n\r\n (Eclesiast√©s 1:14)\r\n\r\n\r\nüìë 22  Se les pidi√≥ despojarse del hombre viejo al que sus pasiones van destruyendo, pues as√≠ fue su conducta anterior,\r\n \r\n23  y renovarse por el esp√≠ritu desde dentro.\r\n \r\n24  Rev√≠stanse, pues, del hombre nuevo, el hombre seg√∫n Dios que √©l crea en la verdadera justicia y santidad.\r\n \r\n\r\nEfesios 4:22-25 [BLA]','2024-09-07 16:13:37','2024-09-07 16:13:37'),(43,58,'EL PODER DE LA LEGALIDAD ETERNA','. Millones tienen detenida la bendici√≥n de Dios, porque consciente o inconscientemente han violado una ley eterna y aunque Dios los ama, chocar contra una ley eterna es chocar contra Dios mismo.\r\nAl que oye mis palabras, y no las guarda, yo no le juzgo; porque no he venido a juzgar al mundo, sino a salvar al mundo. Juan 12:47','2024-09-09 15:06:50','2024-09-09 15:06:50'),(44,50,'From John Anosike \"Roar of War\"','\"Upon this rock I will build my Ecclesia.\" He didn\'t say, \"UponPeter.\" I know that there\'s a cathedral that\'s built on top of the bones of Apostle Peter, well that\'s not what Christ meant.There was something that Peter said that picked the interest of Christ. And He said, \"upon this rock, this foundation shall my ecclesia be built. Upon the foundation, the rock, the foundation of sonship, upon the revelation of sonship shall Ecclesia be built. The true church will never manifest until they rise up as sons, and the gates of hell will not prevail against them. Pause and think about these thoughts. Take time to meditate in your time of prayer, meditate on the understanding of the roar, the sound of Spirit Revelation Ecclesia, a sound of God, the roar ; His voice, the roar; His words the Roar; His vengeance, the Roar ; His judgment, the Roar; his strength, the strength of Ecclesia, it is no ordinary prayer. It is the speaking of mysteries to all creation. Are you aware that you\'re not roaring at God? You\'re aware and you understand the differences in operation per time.\"','2024-09-10 23:39:59','2024-09-10 23:39:59'),(45,41,'Voice of the Lord - Psalm 29','Voice of the Lord:\r\n- Over the waters, the God of glory thunders\r\n- powerful\r\n- full of majesty\r\n- breaks the cedar, splinters the cedar of Lebanon\r\n- divides