al faith. Your emotional activities are capable of destroying your faith in Christ.\" John Anosike','2024-09-12 05:37:02','2024-09-12 09:38:56'),(49,58,'Santa Fe Argentina','Bendiciones Pastores, le cuento lo que Dios est√° preparando y haciendo en Argentina ( Santa fe) como ilgesia estamos alcanzando nuevos barrios de la ciudad estamos llegando a un nuevo barrio donde estamos compartiendo la palabra de Dios, tambi√©n estamos con una hermana de la congregaci√≥n trabajando con los ni√±os de un merendero de aproximadamente unos 40 ni√±os ya tambi√©n proyectando para la ciudad de Santo Tom√© otro merendero para darle a los ni√±os su merienda y la palabra a sus familias, como tambi√©n estamos llevando adelante en la localidad de los Zapallos y  Arroyo del Leyes la palabra junto con ropa y provisiones, pido de sus oraciones estamos queriendo techar un predio de 800 m2 para poder usar como instalaci√≥n de la iglesia principal y poder llevar adelante a la comunidad de la iglesia y alredor ayuda social, espiritual. Muy bendecido con Lion Roaring por el apoyo Esp√≠ritual y econ√≥micamente, seguimos adelante creyendo en lo que Dios prepar√≥ en este tiempo para la iglesia orando por un despert√°r, Avivamiento que las vidas se entreguen a Jes√∫s muy expectantes de lo que el Esp√≠ritu Santo traer√° con el Pastor Timoteo para nuestra congregaci√≥n y localidad me despido con gran alegr√≠a y abrazo en el Se√±or..!!!!','2024-09-15 05:35:40','2024-09-15 05:35:40'),(50,58,'Permanecer en gozo','\"El gozo del Se√±or es vuestra fuerza\" - Nehem√≠as 8:10\r\n la Biblia ense√±a que el gozo es un regalo de Dios, pero que podemos perderlo si nos enfocamos en las cosas equivocadas o nos alejamos de √âl.','2024-09-15 05:39:28','2024-09-15 05:39:28'),(51,58,'Dios te sorprenda en este d√≠a!!!!','Dios te sorprenda en este d√≠a!!!!\r\n\r\nTodo el tiempo estamos tomando deciciones que determinan nuestro futuro. Todo el tiempo estamos tomando deciciones que determinan nuestro futuro. Jes√∫s le contes