g Digital Community Network (LRDnet) y el futuro pertenece a nuestro Se√±or Jes√∫s.','2024-10-17 20:32:03','2024-10-20 13:20:42'),(75,50,'Hebrew 6:1-2','‚ÄúTherefore, leaving the doctrine of the beginning of Christ, let us be led forward unto perfection (fullness of Christ), not laying again ye foundation of repentance from dead works, & of faith toward God, Of the doctrine of baptisms, and laying on of hands, & of the resurrection from the dead, and of eternal judgement.‚Äù (Geneva)\r\n\r\nMinistry begin after we receive power.\r\n\r\n2 Corinthians 3:18 ‚Äú, But we all behold as in a mirror the glory of the Lord with open face, and are changed into the same image, from glory to glory, as by the Spirit of the Lord.‚Äú\r\n\r\nSubdue all dimensions on earth (water.Air, Land).','2024-11-07 19:09:25','2024-11-07 19:09:25'),(76,58,'preparando servicio extraordinario de navidad ninos','Bendiciones les comento que estamos organizando para el mes de diciembre una celebraci√≥n especial de navidad  en la localidad de los Zapallos  provincia de Santa Fe la idea es llevar regalos y alimentos no perecederos para la comunidad que est√°n en necesidad amados pastores y lideres les pido de su colaboraci√≥n en lo que ustedes puedan ayudarnos para poder alcanzar las famllas mas vulnerables de la localidad tenemos mucho por hacer en urgencia y amor en el Se√±or me despido con un gran abrazo las mas ricas bendicen de nuestro Se√±or Jesucristo','2024-11-14 21:02:54','2024-11-14 21:02:54'),(77,67,'Pastor Pablo; 07 Noviembre, 2024 19:09; Translation from English to Spanish','Pastor Pablo; 07 Noviembre, 2024 19:09\r\nHebreo 6:1-2\r\n‚ÄúPor tanto, dejando la doctrina del principio de Cristo, dej√©monos llevar hacia la perfecci√≥n (plenitud de Cristo), no poniendo de nuevo fundamento del arrepentimiento de obras muertas, y de la fe en Dios, de la doctrina de los bautismos, y poniendo de manos, y de la resurrecci√≥n de entre los muertos, y del juicio eterno‚Äù. (Ginebra) El ministerio comienza