his face shine on you and be gracious to you; the Lord turn his face toward you and give you peace. Amen.','2024-12-27 20:31:03','2024-12-27 20:31:03'),(114,58,'Este nuevo ANO QUE COMIENZA','Bendiciones este nuevo ano que comienza es un nuevo capitulo que hay que escribir todo ya esta predeterminado y PREDESTINADO EN LOS CIELOS pero ahora dejemos que DIOS  a trav√©s de nosotros escriba un nuevo capitulo por tu llamado  tu ministerio aqu√≠ en  la tierra en  esta generaci√≥n y en LA NACION QUE NOS TOCO SERVIR  as√≠ que animo y fuerzas porque lo que viene ahora es un nuevo capitulo con nuevas victorias    al final del dia  Todo debe darle alabanza y gloria a nuestro SENOR','2024-12-29 23:38:42','2024-12-29 23:38:42'),(121,50,'Translation of Pastor Pablo','Blessings this new year that begins is a new chapter that must be written everything is already predetermined and PREDESTINED IN HEAVEN but now let GOD through us write a new chapter for your calling your ministry here on earth in this generation and in THE NATION THAT WE HAVE TO SERVE so encouragement and strength because what comes now is a new chapter with new victories at the end of the day Everything must give praise and glory to our LORD. Amen and Thank you.','2024-12-30 14:45:53','2024-12-31 06:10:44'),(122,41,'Roar - testimony','Joel 3:16 - The Lord also will roar from Zion.  And utter His voice from Jerusalem; the heavens and earth will shake; but the Lord will be a shelter for His people.  And the strength of the children of Israel.\r\nHow awesome is the Lord!!  As our group is learning to roar/groan following Ps Anosike 45 min IT (intensive Tongue), I asked the Lord what verse in the bible that I could use as the reference besides Romans 8:26 (groan= roar) so that our group will know that this is not a new or weird thing to follow Ps Anosike using the roar to pray in the spirit.  I am jumping with joy as I started reading the book of Joel and came to chapter 3.  Here is the verse - clearly written to what I am asking Him to show me.  He knows our heart desire and He is the God who will lead us into maturity and promote us in our spiritual journey.  Blessed is His holy name.','2025-01-07 12:35:19','2025-01-07 12:38:28'),(123,41,'Rugido - testimonio','Joel 3:16 - El Se√±or rugir√° desde Si√≥n, y dar√° su voz desde Jerusal√©n; temblar√°n los cielos y la tierra; pero el Se√±or ser√° refugio de su pueblo, y fortaleza de los hijos de Israel. ¬°Cu√°n temible es el Se√±or! Mientras nuestro grupo est√° aprendiendo a rugir/gemir siguiendo el Salmo Anosike 45 min IT (lengua intensiva), le pregunt√© al Se√±or qu√© vers√≠culo de la Biblia podr√≠a usar como referencia adem√°s de Romanos 8:26 (gemido = rugido) para que nuestro grupo sepa que no es algo nuevo ni extra√±o seguir al Salmo Anosike usando el rugido para orar en el esp√≠ritu. Estoy saltando de alegr√≠a cuando comenc√© a leer el libro de Joel y llegu√© al cap√≠tulo 3. Aqu√≠ est√° el vers√≠culo, claramente escrito para lo que le estoy pidiendo que me muestre. √âl conoce el deseo de nuestro coraz√≥n y es el Dios que nos guiar√° a la madurez y nos promover√° en nuestro viaje espiritual. Bendito sea Su santo nombre.','2025-01-07 12:37:02','2025-01-07 12:37:02');
