INSERT INTO `ecclesia_associations` VALUES (1,'OUR ECCLESIA ASSOCIATION','ecclesia-association/xwpW52Bm3JlMPO6f2L5FrkKZp5uz13hzqxdMgNpw.jpg','<p class=\"MsoNormal\" style=\"text-align: left; margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\">Some of our&nbsp;ecclesia partnerships&nbsp;were established before the creation of&nbsp;Lion Roaring PMA and&nbsp;Jesus My King (JMK) Maryland was formed through&nbsp;divine intervention&nbsp;of the&nbsp;priesthood and kingship anointing. These partners are&nbsp;integral to the Lion Roaring assignment, as aligned by God. We are deeply grateful for their support, especially their&nbsp;prayers for us and our families.</p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif; text-align: justify;\"><br></p><p><i>Psalm 2:8, 22:28, 37:9, 47:3 ‚ÄúAsk of me, and I shall give you the heathen for your inheritance, and the uttermost parts of the earth for your possession. For the kingdom is the LORD\'s: and he is the governor among the nations and for evildoers shall be cut off: but those that wait on the LORD, they shall inherit the earth. &nbsp;He shall subdue the people under us, and the nations under our feet. ‚Äù</i></p><p><i>Revelation 2:26-27 ‚ÄúAnd he that overcomes, and keeps my works to the end, to him will I give power over the nations: And he shall rule them with a rod of iron; as the vessels of a potter shall they be broken to shivers: even as I received of my Father. ‚Äù</i></p>','<h3>Current Education Centers:</h3><ol><li><strong>India for Christ Ministries (india)</strong></li><li><strong>Shofarsogreat (israel)&nbsp;</strong></li><li><strong>JMK Shelby, NC (united states of America)</strong></li><li><strong>Grace International (united states of America)</strong></li><li><strong>God Path to Freedom Ministry (united states of America)</strong></li><li><strong>Kingdom-Talents (united states of America)</strong></li><li><strong>Jesus Sovereign King, Santa Fe (argentina)</strong></li></ol><h3>Current Nations:&nbsp;</h3><ol><li><strong>india&nbsp;</strong></li><li><strong>zambia</strong></li><li><strong>israel&nbsp;</strong></li><li><strong>united states of America (oahu, hawaii, shelby, north carolina, moravian falls, north carolina, germantown, maryland)</strong></li><li><strong>sierra leone&nbsp;</strong></li><li><b>argentina</b></li><li><b>bulgaria</b></li><li><b>pakistant</b></li><li><b>malaysia (future)</b></li><li><b>indonesia (future)</b></li></ol>','OUR ECCLESIA ASSOCIATION','Bob Hyde spent 16 years‚Äô working in the education field as a middle school teacher for subjects of United States and world history','Bob Hyde spent 16 years‚Äô working in the education field as a middle school teacher for subjects of United States and world history','2024-03-06 05:59:20','2025-01-31 20:37:38');
