INSERT INTO `home_cms` VALUES (1,'A habitation where supernatural and solution intersects','home/TuNK6JqwaSJ2GPNziLyZZoPql7B74nzj6hs4hVYP.png','home/7g0Gfmvt7ArNvSbdtpBahT5M74Rd8rUWLAiiE7H1.mp4','ABOUT','LION ROARING  PMA','home/P0aOPJfaUKa2ffn1bgaQxWZ6ij2NY2p8lBtylezK.mp4','<p>Lion Roaring Private Members Association‚Äôs (PMA) main focus is to bring Heaven‚Äôs cultures on earth and to restore nations (communities, cities, states, and countries) through each soul whom the Lord has transformed and chosen. This soul will be given the opportunity to work for the Lion Roaring Innovation Centers and its partners being fully educated through Lion Roaring Foundation as God‚Äôs king and priest. The goal for each soul is to create inspired ideas and become self-sufficient to perform good works and bring heaven‚Äôs attributes into its environment.</p>','Daud Santosa','home/9A3tUlCktNEqIeXMUpU2014sZQXBsSeaiQFKigqG.jpg','<p style=\"text-align: left;\"><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: medium; text-align: justify;\">Daud Santosa brings over 35 years of experience as a transformative leader in the IT industry, where he has been instrumental in establishing corporate technology visions and overseeing all aspects of technology deployment and development across both government and industry sectors. His responsibilities have included transforming organizations, people, and technologies to create innovative products and services. These initiatives, such as modernizing infrastructures, launching new business services in the digital space, and creating IT organizations, led to the development of cost models for Enterprise Data Inventory Strategy, Shared Services Centers, Cloud Computing, and IT methodologies. Daud‚Äôs efforts also contributed to balanced scorecards, performance metrics/Service Level Agreements, and automated business processes across Financial, Human Resources, Acquisition, Law Enforcement, Telecommunications, Research, and IT Hosting Services. Throughout his career, Daud has held roles ranging from Software Engineer to Certified Chief IT Lead, IT Executive, and Chief Technology Officer, managing IT budgets in the millions and billions.</span></p><p style=\"text-align: left;\"><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: medium; text-align: justify;\"><br></span><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: medium;\">Daud‚Äôs life was transformed in 2016 after he survived his third brain surgery in late 2015. Starting in 2016, he devoted himself to seeking the Lord daily from 3:00 to 4:30 AM, during which he began receiving divine visions and dreams. He experienced numerous spiritual encounters, including seeing the face of Jesus in the third dimension while on Mt. Sinai. His attendance at the 2017 Open Heaven Prophetic Conference with Prophet Sadhu Selvaraj deepened his spiritual journey. Since then, Daud‚Äôs life has been profoundly changed, and he now walks closely with God, regularly receiving revelations, dreams, and visions. Over the past two years, he has served as a leader under JMK Maryland, a branch of Jesus My King Church in Shelby, North Carolina, equipping his congregation to become wise sowers anointed with Kingship and Priesthood.</span></p><p style=\"text-align: left;\"><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: medium;\"><br></span><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: medium;\">During this time, Daud received the strategy for Lion Roaring (Kingship Authority) and, through the Holy Spirit‚Äôs guidance, established JMK Maryland (Priesthood Authority) in collaboration with Pastor Michael Widjaya and Dr. Steven Francis. God‚Äôs revealed destiny for Daud and his wife is to establish Kingship and Priesthood authority, bringing Heaven to Earth through the office of Christ and the everlasting Kingdom of Light.</span></p><p class=\"MsoNormal\" style=\"text-align: left; margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><br></p><p class=\"MsoNormal\" style=\"text-align: left; margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\">Currently, Daud serves as the elder of JMK Maryland, where he facilitates Lion Roaring teachings on spiritual and leadership development. He is dedicated to restoring individuals, groups, communities, and nations as directed by the Lord.<o:p></o:p></p>','Lystia Santosa','home/7lAhy6PtApuL5YXfPFjtrjpCyvejIh9VadgqBJHY.jpg','Lystia Santosa has over 35 years of experience in the financial and accounting field, specializing in international non-profit organizations. Throughout her career, she has held various roles, including Auditor for a CPA firm auditing Federal Government Grant Programs, Field Office Project Accountant, Senior Accountant, Accounting Manager, Controller, and Director of Finance. Although she obtained her CPA (Certified Public Accountant) early in her career, Lystia chose to forgo a path in public accounting, instead dedicating herself to international non-profit work. Her passion has always been to contribute to organizations whose mission is to improve the standard of living for people in Third World countries.\r\n\r\nBefore retiring in 2019, Lystia served as the Director of Finance (CFO) for the largest U.S.-based international worker rights organization. In this role, she helped advance the organization‚Äôs mission to create safe and equitable workplaces, promote worker equality, and fight against poverty-driven exploitation. Her work also included advocating for better education and collective agreements to improve workers‚Äô living standards. Over her 30+ years with the organization, Lystia gained a comprehensive mastery of financial management, budgeting, human resources, and personnel policies and procedures. She also developed expertise in ensuring compliance with U.S. federal regulations on grant awards and effectively managing relationships with funders, including the U.S. government, foundations, and international donors. She was responsible for overseeing an annual budget of approximately $32 million and directed finance and accounting teams across the headquarters and 30 field offices. As a member of the Executive Team, she collaborated closely with the CEO, COO, and other directors to implement the organization‚Äôs vision and mission.\r\n\r\nSince retiring, Lystia has devoted her time to serving JMK Shelby, North Carolina, by assisting with accounting and financial matters. Alongside her husband, Daud Santosa, she also serves as an elder for JMK Maryland church.\r\n\r\nDuring the pandemic, Lystia‚Äôs relationship with the Lord deepened significantly, and she began studying His Word on a more profound level. This shift in focus led her to prioritize serving God‚Äôs Kingdom over her consulting work. She has since dedicated herself fully to studying scripture and working alongside her husband in serving the JMK Maryland church.','OUR Vision and Mission','<h3>Vision:&nbsp;<i style=\"font-size: 1.75rem;\">To build a thriving community of individuals living in alignment with the divine Kingdom culture.</i></h3><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><i><br></i></p><h3>Mission:&nbsp;<i style=\"font-size: 1.75rem;\">To cultivate a habitation for supernatural solutions through commerce and philanthropic projects that restore nations.</i></h3><h3><br></h3><h3>Motto:&nbsp;A habitation where supernatural and solution intersects</h3><p><b>Jeremiah 33:3 </b><strong style=\"font-style: italic;\">\"</strong><b>Call unto me, and I will answer thee, and show thee great and mighty things, which thou knowest not.\" (Geneva)</b><br></p><p><br></p>','OUR COMMUNITY','<h3><i style=\"font-size: 1.5rem;\">‚ÄúTo travel the pathways of life, it is necessary to know beforehand the path that your conscience outlines, whose spiritual law proceeds from the Divine Spirit.<strong>‚Äù&nbsp;</strong></i><br></h3><h3></h3><h1><p class=\"MsoNormal\" style=\"margin: 0in;\"><font face=\"Hoefler Text, serif\"><span style=\"font-size: 16pt;\">Lion </span><span style=\"font-size: 21.333334px;\">Roaring</span><span style=\"font-size: 16pt;\">&nbsp;community is the backbone of any thriving and successful community. Our principles and values serve as guiding principles that shape behaviors, decisions and the overall culture within a group. Whether we are building an online community or fostering a brand community, understanding and articulating our principles and values are essential.</span></font><span style=\"font-family: &quot;Hoefler Text&quot;, serif; font-size: 16pt; letter-spacing: 0.1pt;\"><o:p></o:p></span></p></h1><h3><strong>You are entering Lion Roaring Digital &nbsp;Ecclesia Network (LRDEnet)</strong></h3><h4><br></h4><h4><br></h4>','TESTIMONIES','A habitation where supernatural and solution intersects','A habitation where supernatural and solution intersects','A habitation where supernatural and solution intersects','2024-03-13 04:55:18','2025-02-07 04:47:24');
/*!40000 ALTER TABLE `home_cms` ENABLE KEYS */;
UNLOCK TABLES;

