INSERT INTO `member_privacy_policies` VALUES (1,'<p>At Lion Roaring, we are committed to protecting your privacy. This Privacy Policy explains how we collect, use, disclose, and safeguard your information when you visit our website&nbsp;<a href=\"https://www.lionroaring.us/\">https://www.lionroaring.us/</a>, browse our Ecclesia &nbsp;Association for books, frames, or other products, and use any other of our services. Please carefully read both the Privacy Policy and our &nbsp;Ecclesia &nbsp;Association Privacy Policy. &nbsp;If you do not agree with the terms of this Privacy Policy, please do not access the site.</p><p><strong>1. Information We Collect</strong></p><p><strong>Personal Data</strong><br>We may collect personally identifiable information, such as your name, shipping address, email address, and telephone number, when you register on the site, place an order, subscribe to our newsletter, or contact us.</p><p><strong>Payment Information</strong><br>Lion Roaring does not collect any payment at this point except donations. Please refer to Lion Roaring, PMA article and disclaimer for donating to Lion roaring PMA.</p><p><strong>Automatically Collected Information</strong><br>When you visit our website, we may automatically collect information about your device, browsing actions, and usage patterns. This may include your IP address, browser type, access times, and the pages you viewed directly before and after accessing the site.</p><p><strong>2. Use of Your Information</strong></p><p>We may use the information we collect in the following ways:</p><ul><li>To process and fulfill your order, including sending you emails to confirm your order status and shipment.</li><li>To manage your account and provide you with customer support.</li><li>To personalize your shopping experience and present products and offers tailored to you.</li><li>To improve our website and services, and for internal analytics.</li><li>To communicate with you about updates, promotions, and special offers.</li></ul><p><strong>3. Sharing Your Information</strong></p><p>We do not sell, trade, or otherwise transfer your personally identifiable information to outside parties except as described below:</p><ul><li><strong>Service Providers:</strong> We may share your information with third-party service providers who perform services on our behalf, such as payment processing, notification, and email delivery.</li><li><strong>Legal Requirements:</strong> Please refer to Lion Roaring article and service provider.</li></ul><p><strong>4. Data Security</strong></p><p>We use administrative, technical, and physical security measures to help protect your personal information. While we have taken reasonable steps to secure the personal information you provide to us, please be aware that despite our efforts, no security measures are perfect or impenetrable, and no method of data transmission can be guaranteed against any interception or other type of misuse.</p><p><strong>5. Your Rights</strong></p><p>You have the right to access, correct, or delete your personal information at any time. You may also opt out of receiving promotional communications from us by following the unsubscribe link in the emails we send.</p><p><strong>6. Children\'s Privacy</strong></p><p>Our website is not intended for children under 13 years of age. We do not knowingly collect personal information from children under 13. If we learn we have collected or received personal information from a child under 13, we will delete that information.&nbsp;</p><p><strong>7. Changes to This Privacy Policy</strong></p><p>We may update this Privacy Policy from time to time to reflect changes in our practices or for other operational, legal, or regulatory reasons. We will post the updated policy on this page and update the effective date at the top. &nbsp;In addition, please refer to Lion Roaring article and disclaimer.</p><p><strong>8. Contact Us</strong></p><p>If you have any questions or concerns about this Privacy Policy, please contact us at:</p><p><strong>Lion Roaring</strong><br>1070 20906 Frederick Rd STE A Germantown, MD 20876<br>+1 (240)-982-0054<br>info@lionroaring.com</p><p>By using our site, you consent to our website\'s Privacy Policy.</p>','2024-04-25 05:35:35','2024-09-19 16:46:54');
