INSERT INTO `organization_centers` VALUES (1,2,'SINGLE PARENTS','single-parents','<p>Our main focus is to empower single parents to lead successful families and educate them to build strong communities through Lion Roaring habitation..</p>','organization_centers/GkX9Dwgg8gh1pMYZsQ0301Mcjo47tVhwchVOCOiK.jpg','organization_centers/MLMgbprOSzptdocwQTfN55wrrPeYPUtTMfARwHWO.jpg',NULL,NULL,NULL,'2024-03-06 05:03:13','2024-08-17 05:15:49'),(2,2,'HOMELESSNESS','homelessness','<p>Our main focus is to see individuals and families set free from addictions and homelessness, transformed by God to become physically and spiritually healthy and to educate them through Lion Roaring community of interest groups.</p>','organization_centers/CD0t7ulkY9e1pLkX1BDEZJLUtx1hyINgbj3AOYRE.jpg','organization_centers/p6zbWLi8GDi0RHqus9QaVhQYvs0ynr8M7tm4LEi3.jpg',NULL,NULL,NULL,'2024-03-06 05:03:59','2024-08-17 05:14:53'),(3,2,'CHILDREN','children','<p>Our main focus is to feed, clothe, shelter and educate children by raising them in the Lion Roaring habitation and train them through Seven Lion Roaring community of interest group.</p>','organization_centers/4y4tN2EXDEJuhVcon9gxYW8t7HA6bz2QbSLOQTbG.jpg','organization_centers/HTqXupD2nXXWBz7zNgWzcZXI6CapzmiisV9kj1LI.jpg',NULL,NULL,NULL,'2024-03-06 05:04:37','2024-08-19 05:48:59'),(4,1,'LION ROARING FOUNDATION','lion-roaring-foundation',NULL,'organization_centers/BI6Mw7Q1kDi0MJxzTlI0suy113nRfLosKYObopHF.jpg','organization_centers/zHbn23yMXwglh1FKQ6hZf3vqSkrTvIVXsiDQTX0B.jpg','LION ROARING FOUNDATION','LION ROARING FOUNDATION','LION ROARING FOUNDATION','2024-03-06 05:07:18','2024-08-17 05:12:57'),(5,2,'PRISONER LIGHTER','prisoner-lighter','<p>Our focus is to restore those affected by Crime &amp; Incarceration by supernatural transformation by God and become physically and spiritually healthy and to educate them through re-entry program through Lion Roaring Community of interest group</p>','organization_centers/mGMibCJNVclr06RxJrsuIratDNJ1o8LsvtYIqB3p.jpg','organization_centers/0grvLVyqzF022Y1sCAZ3NdLG0PuX3DkyaIAC5QlE.png','PRISONER LIGHTER','PRISONER LIGHTER','PRISONER LIGHTER','2024-03-26 12:42:36','2024-08-19 05:45:33'),(6,2,'FAMINE & MALNUTRITION','famine-&-malnutrition','<p>Our main focus is to prevent hunger and malnutrition by providing food and by promoting farming methods sustainability for a hunger free community, strengthening education, nutrition, livelihood resilience and social protection systems such as school meals programs.</p>','organization_centers/rap4TywDE4eLVNR6O0UYi9Rpa9yqjF6ZORPDdrs9.jpg','organization_centers/vQEshseRNsmWw9sGMYlUwXHyLvjn4tKHZc8SFkO1.jpg',NULL,NULL,NULL,'2024-03-26 12:46:47','2024-08-19 05:46:10'),(7,2,'CHILD & DRUG ABUSE','child-&-drug-abuse','<p>Our main focus is to protect children from any form of maltreatment by which is violent or threatening for the child and neglect. To engage the process of helping by providing collaborative intervention services to child abuse victims. Drug abuse can lead to physical and mental damage and dependence and addiction, mind-altering effects. Drug abuse hampers a person‚Äôs power to practice self-control and interferes with their ability to resist the urge to take drugs. Our main focus is to provide education and counseling, seeking help from parents and peers, offering affordable professional and medical helps.</p>','organization_centers/1dsKVCPHm2GdUaS3NivXfO9mCE1Np98uTYz06DuT.jpg','organization_centers/tkNEkHT6Lfcevwl4pgba0GxRn7OeizC0SsOFD8I3.jpg','CHILD & DRUG ABUSE',NULL,NULL,'2024-03-26 12:47:32','2024-08-19 05:46:34'),(8,2,'WELLNESS HEALTHCARE','wellness-healthcare','<p>Our main focus is the wellness and healthcare of underpriviledge people in remote areas, broken communities, villages and cities. By training and equipping local practitioners to reaching out to these people group of assisting them to practicing healthy habits (physical, emotional, intellectual, social, spiritual, environmental and occupational) on a daily basis to attain better physical and mental health outcomes.</p>','organization_centers/unQPIIdtqDHodO9qQpz6ctGqcxFAFrKQDurJNMLp.jpg','organization_centers/fsZI0KWUzqKU18cqQQ2sRTJREMZEwbVOgvO73kOe.jpg','WELLNESS HEALTHCARE','Our main focus is the wellness and healthcare of underpriviledge people in remote areas, broken communities, villages and cities. By training and equipping local practitioners to reaching out to these people group of assisting them to practicing healthy habits (physical, emotional, intellectual, social, spiritual, environmental and occupational) on a daily basis to attain better physical and mental health outcomes.','WELLNESS HEALTHCARE','2024-03-26 12:48:45','2024-08-19 05:47:08'),(9,1,'ENTERTAINMENT & ARTS INNOVATION CENTER','entertainment-&-arts-innovation-center',NULL,'organization_centers/zaVPWoK7NSNnDSGaMQBdFoCO0lK3ZiaNOWVhvzKs.jpg','organization_centers/8f0eScxlc3Mmt5a5Xip4a5tfcuOnQnnRp2h93IfD.jpg','ENTERTAINMENT & ARTS INNOVATION CENTER',NULL,NULL,'2024-03-26 12:51:11','2024-08-19 05:41:51'),(10,1,'MUSIC & MEDIA INNOVATION CENTER','music-&-media-innovation-center',NULL,'organization_centers/cbv6gzzOIPUgcKVuswvqegAHK1eISbWTE227Jjqp.jpg','organization_centers/JmJ6iVjLgBDSjzS0dM4wiIR2uPvdMgRZErhkKMLN.png','MUSIC & MEDIA INNOVATION CENTER',NULL,NULL,'2024-03-26 12:53:04','2024-08-19 05:42:24'),(11,1,'ANIMAL SHELTER & TRAINING INNOVATION CENTER','animal-shelter-&-training-innovation-center',NULL,'organization_centers/BqqyZj6SVnEV3BLmSQ5yQb8ErZHqQ2usLQO0iYIt.jpg','organization_centers/WjAYZjNl5lvhjSfh2mcokn1dGn68Jlzm6hTTctLd.png','ANIMAL SHELTER & TRAINING INNOVATION CENTER',NULL,NULL,'2024-03-26 12:53:34','2024-08-19 05:42:47'),(12,1,'FARMING, FOOD & NUTRITION INNOVATION CENTER','farming,-food-&-nutrition-innovation-center',NULL,'organization_centers/L0m2I6E2LwQbq2BCyI6u4McSA0Hug88mPGhz92cA.jpg','organization_centers/jgTNp1yPjhzPIP8IBrgf0XXQcKvFt6FP4B2FkVz0.png','FARMING, FOOD & NUTRITION INNOVATION CENTER',NULL,NULL,'2024-03-26 12:54:38','2024-08-19 05:43:59'),(13,1,'HEALTHCARE & MEDICINE INNOVATION CENTER','healthcare-&-medicine-innovation-center',NULL,'organization_centers/XsQykNLsldoBQg1RcdrWjviWXZufKvcBy2lSq741.jpg','organization_centers/tgmCO87zwQv2pYG1OgxWG9SDdPGPFkWXJRaed8l7.jpg',NULL,NULL,NULL,'2024-03-26 12:55:10','2024-08-19 05:43:35'),(14,1,'SCIENCE & TECHNOLOGY INNOVATION CENTER','science-&-technology-innovation-center',NULL,'organization_centers/oZ9UyzUuWWJQVYgG9A9Ajnc0sNhMXTO2etblZIZq.jpg','organization_centers/wkPKcrC8gNfKOm9HjcRPBc8OH2ZXeHtyGWwfhFmO.png','SCIENCE & TECHNOLOGY INNOVATION CENTER',NULL,NULL,'2024-03-26 12:56:05','2024-12-09 02:27:53');
