INSERT INTO `organizations` VALUES (1,'OUR ORGANIZATION','<p><span style=\"font-size: 11pt; font-family: &quot;Times New Roman&quot;, serif;\">Lion Roaring Ecclesia was birth out of divine revelation given to Daud and Lystia Santosa, who have been dedicated to fulfilling this God-ordained mission since 2017‚Äì2018. It</span><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\">&nbsp;is a faith-driven organization established through the formation of a Private Members Association (PMA) with a mission to bring Heaven‚Äôs culture to Earth and restore nations by transforming communities, cities, states, and countries.&nbsp;</span></p><h3><font color=\"#ffffff\">Vision:&nbsp;<i style=\"font-size: 1.75rem;\">To build a thriving community of individuals living in alignment with the divine Kingdom culture.</i></font></h3><h3><font color=\"#ffffff\"><span style=\"font-size: 1.75rem;\">Mission:&nbsp;</span><i style=\"font-size: 1.75rem;\">To cultivate a habitation for supernatural solutions through commerce and philanthropic projects that restore nations.</i><i><br></i></font></h3><p><font color=\"#ffffff\"><span style=\"font-family: -webkit-standard; font-size: medium;\"></span></font></p><h3><font color=\"#ffffff\"><a name=\"_Toc189225708\" style=\"transition-property: all; outline: 0px;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif;\"><font color=\"#ffffff\">Motto:&nbsp;</font></span></a><i style=\"font-size: 1.75rem;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\">A Habitation where the Supernatural and Solutions intersects.</span></i></font></h3><div><i style=\"font-size: 1.75rem;\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\"><br></span></i></div>','organization/GrnK6ointhQrmbw3NCH3LGwbHHDfyzA52iDhKSs2.png','LION ROARING INNOVATION CENTERS OVERVIEW','KINGSHIP AUTHORITY','<p>Lion Roaring Innovation Centers</p>','Lion Roaring is Private Members Association organization. The Lion Roaring Governance is described in the following diagrams:','Lion Roaring is Private Members Association organization. The Lion Roaring Governance is described in the following diagrams:','Lion Roaring is Private Members Association organization. The Lion Roaring Governance is described in the following diagrams:','2024-03-07 01:02:40','2025-01-31 20:10:42');
