INSERT INTO `our_governances` VALUES (1,'ROBERT HYDE','robert-hyde','Bob Hyde spent 16 years‚Äô working in the education field as a middle school teacher for subjects of United States and world history. A love of history and the joy of working with children made this a good fit for his career change. Putting aside the content teaching aspect of this profession, most importantly, he learned the importance of relationship building with his students. Without the relationships in place, no teaching will be effective. He also learned the value of cooperative learning and ‚Äúhands on‚Äù or learning by doing, while striving to make learning fun as key components for student engagement and learning. Bob used these strategies as his focus in his teaching and programs like Peer Tutoring, Homework Club, and the National Junior Honor Society that he led throughout his career.\r\nPrior to working in the education field, Bob spent over 20 years in the business world working as a team manager in the insurance industry. Responsibilities included overseeing high dollar claims settlements, personnel management, and customer service. One key takeaway from this profession was the ability to successfully communicate with various stakeholders (superiors, peers, subordinates, customers). Learning skills like compassion and simply listening to others‚Äô needs and desires went a long way to him being able to establish rapport and successful working relationships with all stakeholders.\r\nBob retired from teaching in 2022 and has since concentrated on learning America‚Äôs ‚Äútrue history,‚Äù his rightful status as a united States citizen, loving on and assisting family members through trying circumstances, and by learning and relying on God to become more intimate with his Creator. Individual study and prayer, and teachings from JMK Maryland and Lion Roaring have all helped with Bob‚Äôs spiritual growth. While assisting other leaders as a Board Member of Lion Roaring, Bob is looking forward to his next journey with Lion Roaring and direction from the Lord how best to use him.','our_governances/8VC1259WpyYkRPUjfqYVBjiD85vvGpNuLcR0fiRG.jpg','our_governances/D4RVbxeNVJensk62eVAffWqIKE0hm57GxwzztEhy.jpg','ROBERT HYDE','Bob Hyde spent 16 years‚Äô working in the education field as a middle school teacher for subjects of United States and world history','Bob Hyde spent 16 years‚Äô working in the education field as a middle school teacher for subjects of United States and world history','2024-03-06 00:32:04','2024-03-06 00:32:04'),(2,'DAUD SANTOSA','daud-santosa','Daud Santosa has over 35 years of experience as a transformation leader in the IT industry for establishing the corporate technology vision and leading all the aspects of the corporate technology deployment and development in both Government and Industry sectors. Responsibilites included transforming organization, people, and technologies to create new products and services. These new products and services, including modernization of infrastructures, helped establish new business services in the digital world, create new IT organizations which helped develop new cost models for Enterprise Data Inventory Strategy, Shared Services Centers, Cloud Computing services, and IT methodology. This led to a balance of score cards, performance metrics/Service Level Agreements, and business processes automation in areas of Financial, Human Resources, Acquisition, Law Enforcement, Telecommunications, Research Survey, and IT Hosting Services. Daud has held many different roles ranging from software engineer, Certified Distinguished Chief IT Lead, IT Executive, and Chief Technology Officer. He has managed and had oversight over the IT budget in millions/billions.\r\nThe Lord transformed Daud in 2016 after undergoing and surviving his third brain surgery at the end of 2015. He began seeking the Lord in 2016 by waiting on God every day from 3:00 to 4:30 AM. He had many spiritual encounters through dreams and visions in 2016-2017. He saw Jesus‚Äôs face in the 3rd Dimension when he was on Mt. Sinai. He also attended the Open Heaven Prophetic Conference with Prophet Sadhu Selvaraj in 2017. Since then, his life has changed as he regularly walkiswith God. He continues to experience many visions, dreams, and revelations. The Lord has taught him over the past two years as a leader under JMK Maryland (a branch of Jesus My King Church, Shelby, North Carolina) to prepare his congregation to become a wise Sower with Kingship and Priesthood anointing.\r\nAlos, during this time, he received the strategy of Lion Roaring (Kingship Authority) and established JMK Maryland (Priesthood authority) through divine intervention of the Holy Spirit as he connected with Pastor Michael Widjaya and Dr. Steven Francis. This is God‚Äôs destiny as revealed to Daud and his wife; that is to establish Kingship and Priesthood authority where Heaven is brought on earth with the office of Christ, which is the office of the everlasting Kingdom of Light.\r\nCurrently, he is the elder of JMK Maryland that helps that facilitate Lion Roaring teachings on Spiritual and Leadership Development by helping to restore one person, group, community, and nation at the time as the Lord directs him.','our_governances/64PRIqvLsKzoKx21IKjhBDatCiIQ92D8EkSeCkbv.jpg','our_governances/f2rEvSGf6P47ASO8jQJIWu5PefAMd8FI1GfWaK6x.png','DAUD SANTOSA','Daud Santosa has over 35 years of experience as a transformation leader in the IT industry for establishing the corporate technology vision and leading all the aspects of the corporate technology deployment and development in both Government and Industry sectors.','Daud Santosa has over 35 years of experience as a transform','2024-03-06 00:34:48','2024-12-13 07:24:20'),(3,'LYSTIA SANTOSA','lystia-santosa','Lystia Santosa has over 35 years of experience working in the financial and accounting field for International Non-profit Organizations. She has held various positions during her career such as an auditor for a CPA Firm auditing the Federal Government Grant Programs, a Field Office Project Accountant and Senior Accountant, Accounting Manager, Controller, and then a Director of Finance position. Although Lystia obtained her CPA (Certified Public Accountant) early in her career, she decided not to pursue a career in the Public Accounting but to devote her career working for an international non-profit organization working with the third world countries. It was her passion to work in an organization in which the primary mission and the vision were to help people in Third World countries to improve their standard of living.\r\nPrior to her retirement in 2019, she held a position as the Director of Finance (CFO) working for the largest U.S. based international worker rights organization. She helped facilitate the organization‚Äôs mission of helping workers attain safe and healthy workplaces, while promoting worker‚Äôs equality. She also helped improve workers‚Äô standard of living with education and collective agreement, and by helping fight discrimination, and by pr eventing the exploitation of systems that entrench poverty. Her 30 plus years‚Äô experience working with this organization gave her solid and broad mastery in all areas in financial management, financial affairs, budgeting, human resources and personnel policy and procedures. Furthermore, she developed expertise to ensure compliance with U.S. Federal Rules & regulations on grant awards, and how to effectively deal with the the organization‚Äôs funders (U.S. Government, foundation and international donors). She was responsible for the organization‚Äôs annual budget of about $32,000,000.00 and directed staff in the finance and accounting departments at the company‚Äôs headquarters, and approximately 30 filed offices. Additionally, she was a member of the Executive Team, and she worked closely with the CEO, COO and other Directors in the implementation of the organization‚Äôs vision and mission.\r\nSince retiring in 2019, Lystia has been volunteering her time in helping JMK Shelby, North Carolina church with their accounting and financial matters. She is also the elder for JMK Maryland church alongside her husband, Daud Santosa.\r\nDuring the pandemic, the Lord brought her into a more intimate relationship with Him and helped train her to study His words on a deeper level. This helped shift her priorities from working from a worldly employer to working for God‚Äôs Kingdom. She gave up her consulting work and completely devoted her time to studying and working alongside with husband, Daud Santosa in serving the JMK Maryland church.','our_governances/N0aurkNOPyQtw2vJUo1Ndn86mEuyTRO1bZlk0yC2.jpg','our_governances/tsxaA2GAAYYwN2rsVQ9RQCjNCQtw76FgBFxEzwyI.jpg','Lystia Santosa has over 35 years of experience working in the financial and accounting field for International Non-profit Organizations','Lystia Santosa has over 35 years of experience working in the financial and accounting field for International Non-profit Organizations','Lystia Santosa has over 35 years of experience working in the financial and accounting field for International Non-profit Organizations','2024-03-06 00:35:34','2024-03-06 00:35:34'),(5,'IRENE SUBOWO','irene-subowo','Irene Subowo was born and raised in a Christian family in Indonesia until age 25 when she and her husband migrated to the United States of America. She gives tribute to her parents for instilling moral values and as the greatest influencers and role models for her life in serving the Lord. She began her ministry at a very young age as a church organist and as a Sunday School teacher in the Christian Orphanage. Later, she was appointed Director of Children and Youth Ministry at the church she attended in Indonesia.\r\nIrene studied Landscape Architecture and Management Information Systems and has 18 years‚Äô experience in both fields. As a landscape designer in Indonesia, her professional assignment included landscape design, implementation, and maintenance of real estate and residential properties.\r\nAfter having worked with the largest grassroot non-profit organization in the nation, a leading voice on mental health, Irene switched professions to IT environment after migrating to the U.S. Thereafter, she oversaw a large multi database system that provided data support to help streamline membership and donor data from local and state affiliates. Later, she put her career on hold to devote more time to raising her two beloved children.\r\nIn her previous church, Irene was part of the Women‚Äôs Ministry and served as the Hospitality Team Leader. Additionally, she managed many church events for 20 years. From 2000-2013, she was the Assistant Director of ESL Program, which served more than 75 students from many countries in twice weekly sessions.\r\nAfter patiently waiting for God‚Äôs direction and seeking his path for her life for seven years, Irene joined JMK Maryland in November 2020. She holds on tight to God‚Äôs words in Psalm 25:4-5 which drive her in seeking God‚Äôs wisdom in this new season of her life. ‚ÄúMake me know Thy ways O lord; Teach me in Thy paths, Lead me in Thy truth and teach me, for Thou art the God of my salvation; For Thee I wait all the day‚Äù.\r\nGod has ignited the fire in Irene‚Äôs heart and aroused her hunger to serve Him more as she waits upon the Lord for further direction for the ministry that He calls her for. She believes that He who has begun making His desire as her own, He will confirm it and prepare it for His plan. It is all about Him, the grand Master of everything. She believes she has a high calling to run the race and finish the course God has uniquely designed for her. Now is Irene‚Äôs time to get even more excited about serving God wholeheartedly and to become everything God wants her to be. She is currently sitting as Board Member of Lion Roaring Ministry and serving JMK Maryland church.','our_governances/gALzQNZdXhLbNZk3nIs2mig2f3v0F6zeI4vJT2nO.jpg','our_governances/EUYdVw8FYl4HYtZkoEQJG1CcXhx6kfrpSHdi6D81.jpg','IRENE SUBOWO','Irene Subowo was born and raised in a Christian family in Indonesia until age 25 when she and her husband migrated to the United States of America','Irene Subowo was born and raised in a Christian family in Indonesia until age 25 when she and her husband migrated to the United States of America','2024-03-26 00:20:34','2024-03-26 00:20:34'),(6,'SANNY SUBOWO','sanny-subowo','Sanny Subowo‚Äôs professional journey began about 3 decades ago right after he attained his third master‚Äôs degree in computer science. Experienced in the IT industry in the Federal and Commercial space, Sanny worked on various technical and project management tasks, involving database integration technologies on multiple platforms. He developed a diverse technical background while working for Enterprise System Solutions, and he has a proven ability to implement technologies to maximize performance.\r\nHis spiritual journey began at a young age when a family friend introduced him to Christianity. Not long after that, he was baptized (sprinkling of water) in the name of the Father, Son, and the Holy Spirit. As a teenager, he went through a confession of faith in front of the church congregation as part of church doctrine.\r\nAfter becoming an adult and joining a non-denomination church, Sanny was re-baptized by being immersed in the water. The baptism signifies the death, burial, and resurrection of Jesus Christ. As Sanny‚Äôs spiritual maturity grew, he was actively involved in various ministries for several years. He assisted with the media ministry that was responsible for preparing worship songs and running the power point slide presentations during Sunday services. He was also part of the ESL ministry, and he led the teaching of basic computer skills and MS word & excel. He was a member of the men‚Äôs ministry, and together with other brothers in Christ did door-to-door neighborhood visits to introduce the Gospel.\r\nSanny‚Äôs hunger and seriousness to know and to learn more about the Gospel started after returned from his pilgrimage to Israel in October 2018. Thereafter, he developed an intimate relationship with the Lord by regularly reading and studying the word. A turning point came about after attending the USA Prophetic Convention in 2019 ‚Äì God‚Äôs Word for America. He experienced worship in the spirit to the living God, which was like worship in heaven. The teaching prophets Sadhu Sundar Selvaraj and Dr. Steven Francis opened his heart, soul, and mind to a deeper understanding of the word. This is vitally important because it is a preparation for and a prerequisite to receive personal revelation from the Lord.\r\nIn 2020, with the blessing from his pastor, he decided to leave his church to join JMK MD to pursue in depth teaching and to become a more mature Christian. The verse that resonates profoundly to Sanny is Matthew 6:33 ‚Äì seek first His kingdom and His righteousness, and all these things will be provided to you. Moreover, Jeremiah 29:13 says ‚ÄúAnd you will seek Me and find Me when you search for Me with all your heart‚Äù.\r\nThe Lord has put the following commandments upon Sanny‚Äôs heart:\r\n‚Ä¢ Love the Lord our God and love the people around him.\r\n‚Ä¢ Share the word and give support to others. Much can be said about one‚Äôs expression after attaining Godly knowledge and support from His followers through His\r\nword and blessings. It is priceless.','our_governances/ASfJUwFFVPpxzQZ2GDcroWOCx7ufIaWY5CVy7XKU.jpg','our_governances/fPUkp1dJva2MNmKNEvh9EGH3xnTyyvviNGAsRbbV.jpg',NULL,NULL,NULL,'2024-03-26 00:21:11','2024-03-26 00:21:11'),(7,'JASMINE GOH','jasmine-goh','Jasmine Goh has over 30 years of experience working in the financial accounting field with the primary focus of administering and managing personnel benefits for International Non-profit and private organizations. She has held various positions during her career as receivable and payable coordinator, accountant, payroll and benefits coordinator, controller, and then achieved a Director of Accounting position. She has devoted most of her career to working for an International Not-Profit organization. The organization supports and leverages the resources of international agricultural research establishments by providing centralized management of specialized global personnel functions to include payroll, employee benefits, risk management, and compliance to reduce administrative time and costs. The pooling of resources allows the member organizations to focus on their missions ‚Äì achieving sustainable food security and reducing world poverty.\r\n\r\nFor the past 10 years, Jasmine has held the position as Director of Accounting with this International Non-profit organization, resulting in wide-ranging knowledge in all areas of payroll dealing with international wire transfers to over 80 countries in various currencies, tax compliance, while allowing her to enhance her skills in the process. Furthermore, she manages the organization‚Äôs $12.3 million in benefits per month (approximately $147 million annually) and administers $667 million in retirement assets for over 2,000 international recruited staff members that work in over 80 countries in the world. Additionally, she is a member of the Executive Team that works closely with the President/CEO, Director of Finance, and the board members in the implementation of the organization‚Äôs vision and mission.\r\nIn October 2018, Jamine had the opportunity to travel to the various biblical sites such as, Egypt, Israel, and Jordan. It was a life-changing experience for her. She experienced firsthand the locations where her Lord Jesus was born and baptized, and where he preached, performed miracles, and where he was crucified. Thereafter, she fervently sought her savior and came away with a deeper understanding of God‚Äôs kingdom and His will. She continued her pursuit by reading and listening to the teaching of the second coming of our Christ Jesus, and she has participated in online classes, seminars, and workshops.\r\nDuring the pandemic, by God‚Äôs grace, her senses were heightened an, and by enjoying God‚Äôs creation through nature. Her priority to spend more time with her Lord Jesus became even more focused despite holding a full-time job. In one of her pastor‚Äôs sermons, the pastor taught about being the best one could be in the work environment by operating as ‚ÄúSpiritual Intelligent Agent‚Äù for God‚Äôs kingdom. This message furnished confirmation and comfort and showed her she was in the season of her life where she should be and told her to be ready to be used as God calls her to work in His fields. Going forward, Jasmine wants to focus on Christ Jesus and run the race for HIs kingdom until the day we are called and seated at the right hand of the throne of God. Hebrew 12:1-2 (NKJV) Therefore we also, since we are surrounded by so great a cloud of witnesses, let us lay aside every weight, and the sin which so easily ensnares us, and let us run with endurance the race that is set before us, 2 looking unto Jesus, the [a]author and [b]finisher of our faith, who for the joy that was set before Him endured the cross, despising the shame, and has sat down at the right hand of the throne of God.\r\nShe became a member of JMK Maryland Church as of November 2020. She is currently assisting with the elders of JMK with various ministry projects.','our_governances/6uqgApFQsAF2hjcFnzOoqj28jm1McvGaxRSmxwZY.jpg','our_governances/RYusfsC0T7WB5JsuNff8ookabEVySXitmw89zqN1.png',NULL,NULL,NULL,'2024-03-26 00:21:56','2024-03-26 00:21:56'),(8,'ELIZABETH CHIRWA','elizabeth-chirwa','The first lady, Elizabeth Chirwa, had the privilege to grow up and be educated while working in a multicultural environment. Elizabeth was raised Christian and was instilled with Christian values throughout her familial upbringing in Zambia. As a result of her marriage to her late husband, Christopha Chirwa, she was exposed to international organizations and communities as she followed her husband, who was assigned by the Office of former President Kenneth Kaunda of Zambia to work for the International Monetary Fund in Washington DC.\r\n\r\nElizabeth attained a bachelor‚Äôs degree in business administration in Zambia. She worked as an Assistant Manager in the Standard Chartered Bank in Lusaka with various roles and responsibilities of managing day to day banking affairs. She was also responsible for training the bank tellers in the branch where she worked. Once her family relocated to Washington DC, she continued her education and attained a Diploma in the Principle of Business from Montgomery College in Maryland, USA, and achieved three Certifications in Divinity Studies. Thereafter, she held a Customer Service Manager position for 10 years at one of the giant retailers in the United States. Throughout her career, Elizabeth has exhibited exemplary leadership skills by demonstrating accountability and courage, by building trust while communicating effectively, all while managing the performance and helping to develop talent of team members under her supervision.\r\n\r\nThe Laws of Maximizing Relationship and Execution principles further encouraged Elizabeth to become a Small Business owner of two entities: Integrity Office Maintenance Services, LLC, a for profit company providing maintenance and cleaning services for various business offices, and Integrity Homeless Children Outreach, a nonprofit organization. In her capacity as the Executive Director of the Integrity Homeless Children Outreach, her ministry has served the homeless, fed, and distributed food through the county program, preached the gospel, and prayed for and baptized the homeless as they accept the Lord Jesus.\r\n\r\nCurrently she is partnering with Abishai Christian Academy School and Home of Happiness for Children with Disabilities and Orphanage in Lusaka, Zambia. Her ministry in this partnership includes providing financial and spiritual support for the orphanage and words of encouragement while helping mentor the orphanage and school‚Äôs leadership. The latest orphanage project is to raise chickens with the goal of generating income for the orphanage to ensure financial self-sufficiency long-term.\r\n\r\nIn her spiritual journey as the Lord Jesus‚Äôs disciple, she has committed her life to various studies, to help her motivate, empower, serve, and inspire others in her church, community, and the various places where the Lord has commanded her to minister. She used this calling as Coordinator for the Women‚Äôs prayer group in the United Methodist Church, and as a children Sunday school teacher in Bethesda, Maryland church and intercessors. Elizabeth also attained a certification from Gethsemane Prayers School of Deliverance and Healing and certification from the School of Warfare & Deliverance in New York. She was ordained and consecrated as an International Chaplain Alliance in Maryland. She also had the privilege to serve as an Elder under the Board Elders for Prophet Morris Cerullo World Evangelism between 2016 to 2020.\r\n\r\nHer gift as a prayer warrior has brought her to many different places to minister to those in need. As a woman responding and answering to a call from GOD to share the love, peace, grace, faith, and hope of the gospel with needy individuals, she has faithfully committed herself to serve others. Her intercessor gift has connected her with Pastor Dirlene Cannon from Grace International Church. Elizabeth is a member of JMK Maryland as of November 2020 and is one of the intercessors for JMK Maryland church.','our_governances/IS4SOGpuLZINAQrK7MoJ936GbsNBkcCAWkjSdAWl.jpg','our_governances/5Mp7ROnb9viX5A7iRRozxsGesLeQ2Su88KccPGtP.png',NULL,NULL,NULL,'2024-03-26 00:22:43','2024-03-26 00:22:43');
