INSERT INTO `our_organizations` VALUES (1,'Lion Roaring Innovation Center','lion-roaring-innovation-center','The mission of Lion Roaring innovation center is building the future of innovation technologies to support the vision of Lion Roaring and to support natural habitation that follows Psalm 104:14-18, 24-25 ‚Äì ‚ÄúGod cause grass to grow for the cattle, herb for the service of man: bring forth food out of the earth; and wine that makes glad the heart of man, and oil to make his face to shine, and bread which strengthens mean‚Äôs heart. In wisdom God made them all: the earth full of your riches‚Äù. This innovation will be leveraged to help restore villages, cities, states, and nations through Lion Roaring Education Centers.','our_organizations/RoFGvUKvvRXGbbpMmlp9xUt00pICuBwVYHlFMOVN.jpg','2024-03-06 01:07:38','2024-03-12 07:53:18'),(2,'Lion Roaring Education Center','lion-roaring-education-center-1709707179','The mission of Lion Roaring Education Centers (LREC) is to educate each person to embrace the kingdom of God by restoring the soul through the salvation of the Lord Jesus. In doing so, LREC will also help develop spiritual maturity through spiritual growth and transformation. And to nurture those skills according to that person‚Äôs giftedness within the circle of the Lion Roaring Community of interest groups and within the Lion Roaring Habitation and partnership around the world.','our_organizations/Vuqu2PVoVJkJJB03Aq9UcE9Kd9XPGsZNRFeH186f.jpg','2024-03-06 01:08:35','2024-03-26 03:51:21');
