INSERT INTO `pma_terms` VALUES (1,'LION ROARING PRIVATE MEMBERS ASSOCIATION (PMA)','<h3 style=\"text-align: center; \">&nbsp;DISCLAIMER</h3><p style=\"text-align: center;\">Lion Roaring PMA is a private members association of the participants for educational and informational purposes only. None of the postings of education and information materials can be construed as advice, directive, opinion or recommendation for the members to initiate actions. The contents of the Lion Roaring (LR) website reflects the mission, vision, strategies, and ecclesias‚Äô testimonies of LR PMA. The educational teaching modules are based on our belief and faith in Jesus Christ, biblical foundation and personal experiences which we choose to share for education purposes and spiritual journeys of our faith.</p><p style=\"text-align: center;\">In order to protect all members from any adverse interference or action brought on by local, county, state, or federal regulatory, administrative or licensing agencies, and to receive full benefits from participation in Lion Roaring Private Member Association, (hereafter referred to as PMA) all visitors accessing the Lion Roaring website consent to the following:</p><ul><li style=\"text-align: left;\">All member‚Äôs information and postings displayed in the website are privileged information for the members‚Äô benefit and access only. Any unauthorized use, collection, storing or sharing of the content or information from the website is prohibited</li><li>Visitors will not hold Lion Roaring PMA liable for any materials or contents posted in the website</li><li>Any disclosure, reproduction, distribution, forwarding or other use of the LR PMA website content or any attachments to an individual or entity other than the intended recipient is prohibited</li></ul><p><br>&nbsp;</p>','2024-05-08 03:24:56','2024-05-08 03:55:52');
