INSERT INTO `principal_and_businesses` VALUES (1,'OUR VALUES AND BUSINESS MODEL','principle-and-business/vKt9sJt7P4bsY291afQr30ghvqQSLdmI4A9KGGO7.png','principle-and-business/m6Jn5ZEfCs6EgJ9rdKZJAIBw0maS4JmgKr8VmYSm.png','<h1>Our Values</h1><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span class=\"uv3um\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">The principles of Lion Roaring PMA excellence typically include:<span class=\"apple-converted-space\">&nbsp;</span>commitment to excellence, people-oriented focus, continuous improvement, member engagement, strong leadership, accountability, clear communication, process improvement, data-driven decision making, and a culture of learning and innovation, all aimed at achieving high performance and consistently delivering value to our member and people through optimized processes and engaged Lion Roaring members.</span><span class=\"uv3um\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">&nbsp;</span></span></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-size: 13.5pt; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 29, 53); background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><span style=\"font-size: 13.5pt;\">Key elements of our Lion Roaring PMA excellence principles:</span></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\">People and Members Focus:<o:p></o:p></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">Prioritizing customer needs and expectations as the central driver for all Lion Roaring activities<span style=\"letter-spacing: 0.1pt;\">.</span></span><span class=\"uv3um\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt;\">&nbsp;</span></span><span class=\"uv3um\"><span style=\"font-size: 13pt; font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt;\"><o:p></o:p></span></span></p><p class=\"k3ksmc\" style=\"margin: 0in 0in 6pt; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Leadership Commitment:</strong><o:p></o:p></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">Active leadership engagement in setting the vision, promoting a culture of excellence, and providing necessary resources</span>.<span class=\"uv3um\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 29, 53); letter-spacing: 0.1pt;\">&nbsp;<o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span class=\"uv3um\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 29, 53); letter-spacing: 0.1pt;\"><o:p>&nbsp;</o:p></span></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Continuous Improvement:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Embracing a mindset of ongoing improvement across all levels of the Lino Roaring PMA through data analysis and process optimization.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Members Engagement:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Fostering a positive work environment where members feel valued, empowered, and motivated to contribute their best.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Accountability:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Establishing clear individual and team accountability for achieving goals and delivering result</span><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Open Communication:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Promoting transparent communication at all levels to ensure alignment and address issues promptly.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Process Management:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Analyzing and optimizing work processes to eliminate waste and improve efficiency.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Data-Driven Decision Making:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Using data insights to inform strategic decisions and measure progress.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Innovation and Learning:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Encouraging creativity and continuous learning to adapt to changing market conditions</span><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; color: rgb(84, 93, 126); letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"><o:p>&nbsp;</o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><strong>Respect for Individuals:</strong><strong><span style=\"font-weight: normal;\"><o:p></o:p></span></strong></h2><h4><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-size: 13.5pt; font-family: &quot;Helvetica Neue&quot;; color: rgb(0, 29, 53); background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\"></span></p><p class=\"MsoNormal\" style=\"margin: 0in; font-size: medium; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-family: &quot;Helvetica Neue&quot;; letter-spacing: 0.1pt; background-image: none; background-position: 0% 0%; background-size: auto; background-repeat: repeat; background-attachment: scroll; background-origin: padding-box; background-clip: border-box;\">Valuing diversity and treating every employee with respect.<o:p></o:p></span></p></h4><h2 style=\"margin: 2pt 0in 0in; break-after: avoid; font-size: 13pt; font-family: &quot;Calibri Light&quot;, sans-serif; color: rgb(46, 116, 181);\"><br></h2>','<h3>Rules of Behaviour&nbsp;</h3><h3><ol style=\"font-size: 14px;\"><li class=\"MsoNormal\" style=\"color:#212529;mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\n     auto;mso-outline-level:3;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">Focus on others and love them as you love yourselves.<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color:#212529;mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\n     auto;mso-outline-level:3;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">Obedience to God and to the Lion Roaring Leadership council.<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color:#212529;mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\n     auto;mso-outline-level:3;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">Be a witness and bear fruit by creating heavenly attribut</span><span style=\"font-size: 10.5pt; font-family: &quot;EB Garamond&quot;;\">es.<o:p></o:p></span></li></ol></h3>','<h3>Oath of Office</h3><h3><ol style=\"font-size: 14px;\"><li class=\"MsoNormal\" style=\"color:#212529;mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\n     auto;mso-outline-level:3;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">To be faithful, and to fear God above many.<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color:#212529;mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\n     auto;mso-outline-level:3;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">To restore our home, communities, cities back to God‚Äôs law (Supreme law) and Common Law. Restore to become self-government that based on God‚Äôs law.<o:p></o:p></span></li><li class=\"MsoNormal\" style=\"color:#212529;mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\n     auto;mso-outline-level:3;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">To create a heavenly culture and its attributes on earth within Lion Roaring communities. This will help impact communities through its culture.<o:p></o:p></span></li></ol></h3>','<h3>Business Model</h3><h3><p class=\"MsoNormal\" style=\"margin: 0in 0in 18.75pt; font-size: medium; font-family: &quot;Times New Roman&quot;, serif; line-height: 18pt;\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">Our Lion Roaring Business Model will follow Joseph‚Äôs example in the book Genesis 47:20-26. Lion Roaring will buy many of the assets during difficult times based on God‚Äôs direction only. In turn, it will restore villages, cities, states, and countries by providing people with a place to work and produce natural resources based on the seven lines of businesses. Twenty percent of the revenue will be given back to Lion Roaring for the next seven years.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 18.75pt; font-size: medium; font-family: &quot;Times New Roman&quot;, serif; line-height: 18pt;\"><span style=\"font-family: &quot;Helvetica Neue&quot;;\">The people give back twenty percent to Lion Roaring of which 10% goes to the local Pastor and 10% to the Lion Roaring Ministry locally. The people keep 80% for living.<o:p></o:p></span></p></h3>','<h3><br></h3><h3><span style=\"font-size: 14px;\">.</span><br></h3>','OUR PRINCIPLE AND BUSINESS MODEL','OUR PRINCIPLE AND BUSINESS MODEL','OUR PRINCIPLE AND BUSINESS MODEL','2024-03-06 06:53:07','2025-02-06 09:03:58');
