product-category/authors/john-paul-jackson/',NULL,NULL,NULL,'Needless Casualties of War',NULL,NULL,1,0,0,'2024-08-10 21:38:58','2024-11-01 07:43:54','Prayers'),(22,4,1,'Kingdom Talents','<p>Our mission is to help you protect your wealth against currency devaluation and any economic disasters. Kingdom Talents Gold &amp; Silver Investments manufactures pure .9999 gold and .999 silver bullion called Gold and Silver Talents with original Biblical artwork. You can take physical possession of the precious metals, and/or you can take advantage of our storage program. Also, we offer an facilitate precious metal IRA roll overs.</p>','Gold and Silver',NULL,'<p>Gold and Silver Investment</p>','https://kingdom-talents.com',NULL,NULL,NULL,'Gold and Silver',NULL,NULL,1,0,0,'2024-08-12 11:03:10','2024-08-26 03:23:07','Gold and Silver'),(23,4,1,'Glory Harp','<p>Each Glory Harp is lovingly crafted by anointed harpists to encourage the body of Messiah (Christ) to worship YAHWEH (the LORD) with the instrument of heaven, the harp;&nbsp; to declare the word of YAHWEH through singing the Bible; and to sing the songs of the Holy Spirit as He leads us.</p>','Glory Harp is lovingly crafted by anointed harpists',NULL,'<p>Each Glory Harp is lovingly crafted by anointed harpists to encourage the body of Messiah (Christ) to worship YAHWEH (the LORD) with the instrument of heaven, the harp;&nbsp; to declare the word of YAHWEH through singing the Bible; and to sing the songs of the Holy Spirit as He leads us.</p>','https://www.gloryharpscompany.com',NULL,NULL,NULL,'Harp',NULL,NULL,1,0,0,'2024-08-12 11:17:41','2024-08-26 03:23:34','Products'),(24,5,1,'Angel TV','<p>Prophetic voice from Sadhu Selvaraj</p>','Angel TV to experience Divine Inspiration',NULL,'<p>Prophetic voice from Sadhu Selvaraj</p>','https://www.youtube.com/channel/UCVRh_8fyUuMj7Tuqp5O3HpA',NULL,NULL,NULL,'Angel TV to experience Divine Inspiration',NULL,NULL,1,0,0,'2024-08-16 21:01:26','2024-08-26 03:22:39','Prophecies and Teaching'