INSERT INTO `register_agreements` VALUES (1,'LION ROARING PMA (PRIVATE MEMBERS ASSOCIATION) AGREEMENT','<p>It is the responsibility of the members to read and review the Articles of Association of Lion Roaring PMA in its entirety and agree to adopt and comply with its belief, foundation, and purpose of the Lion Roaring PMA. <a href=\"https://lionroaring.us/storage/article_of_association/wt5CZsoUzVopVYAHhfjw93fB7YysVQNNHu6ImfE4.pdf\"><strong>Click here to read the full document</strong></a></p><h4><strong>Each member agrees to the following excerpt taken from the Articles of Association of PMA:</strong></h4><ul><li>1. Lion Roaring PMA is a Private Members Association protected under the Constitution of the United States of America and the original constitution for these united States of America and the Maryland Constitution</li><li>2. Member agrees and is supportive to the mission and vision of the Lion Roaring</li><li>3. Member strives to contribute to the purpose of the PMA to fulfill the God given call to the founding members as it is written in Section 4 through 15 in the Article of Association</li><li>4. Member will not hold Lion Roaring PMA liable for any materials or contents posted in the website or any paperwork, written articles, education materials or others created within the PMA for its members‚Äô benefits and private usage</li><li>5. Member‚Äôs agreement does not entitle a member to any financial or other interest in the Private Members Association or management thereof</li><li>6. Information regarding details of the association, any materials produced or created by Lion Roaring PMA including all paperwork, agreements, articles, PowerPoints presentations, word parchments, coaching, and education materials are private intellectual property of the PMA and will not be shared, replicated, dispersed or distributed with anyone outside the PMA without explicit written permission from the founder</li><li>7. Member‚Äôs due diligence is expected and member will hold harmless any member or founder of Lion Roaring PMA and any dispute shall be handled by the founder(s) with final decision for remedy made by the founder(s) and shall be accepted as a settled matter. (Article III for disputes resolution &amp; Article IV for Sovereignty in the Private)</li><li>8. As a private member of the Lion Roaring PMA, member is invoking its united States constitutional rights specifically the 1st, 4th, 5th, 9th and 10th and the Maryland Constitutional rights included in the Maryland Declaration of Rights Sections 1, 2, 6, 10, 24, 26, 36, 40 and 45 and as such take full responsibility for his or her behavior, such that his or her actions shall never constitute anything that can be determined to be of a ‚Äúclear and present danger of a substantial evil.‚Äù</li><li>9. Any actions by the member which are not consistent with the values of the PMA can result in the founder‚Äôs decision to ask the member to leave the PMA</li><li>10. Member is connected with each other and the actions affect one another, therefore, the Lion Roaring PMA encourages and supports one another as a family and community</li><li>11. Member and those who are included in this member‚Äôs agreement and contract are solely responsible for member‚Äôs own outcome or results from participating or receiving any education materials, counsel, coaching, training, mentoring or other services provided by Lion Roaring PMA through its websites or any other resources made available to the members</li><li>12. The terminology used in these articles of organization and member‚Äôs agreement is used solely for clarification of the various usages for Private Members Association under universal contract law by and between free, spiritually free men and women, creations of nature and Natures God, whose lives and rights derive from God Almighty and unique Covenant of the man and/or woman with the Creator</li><li>13. Any reference within the Articles of Association to the man shall also include the woman and any reference to one people may include many people. This PMA shall be construed and interpreted in the private and all decisions or disputes will be final as settled by the founders in accordance with Article III</li><li>14. Member agrees that the elimination of one Item or segment of this Agreement does not eliminate the entirety of the Agreement but the Agreement will remain as Agreed</li></ul><p><br>&nbsp;</p>','2024-04-19 08:02:36','2024-11-12 08:50:43');
