INSERT INTO `reviews` VALUES (1,11,13,'Product is so good',4,1,'2024-07-22 02:01:52','2024-07-22 02:01:52'),(2,3,1,'Very Good Product....And Product Quality is So Good.',4,1,'2024-07-22 02:04:58','2024-07-22 02:04:58'),(3,6,1,'It was my first novel that i completed within a day!!!Each chapter gave a thrilling end that made me keep going without holding...i loved the way the author has given a touching end...This is a typical Indian author novel which would satisfy anybody who is looking for good & simple entertaining,thrilling,romantic novel..',3,1,'2024-07-22 02:08:06','2024-07-22 02:08:06'),(4,4,1,'The plot was very well thought and laid out beautifully',2,1,'2024-07-22 02:14:22','2024-07-22 02:14:22'),(5,7,1,'A very nice story with a good characterization. The way the story moved and the way the story revolved around the characters was very good. Sidharth and lekha made a very good pair than athul and archana. A good entertaining novel from a debut author. He will make a promising successful author in future. Expecting more works from him.',4,1,'2024-07-22 10:49:24','2024-07-22 10:49:24');
