ail.com,dsantosa@lionroaring.us',NULL,'Testing','<p>Test</p>',NULL,0,0,NULL,'2024-11-27 09:21:38','2024-11-27 09:21:38'),(160,121,50,'ssubowo@protonmail.com,main@yopmail.com','dsantosa@lionroaring.us','Testing','<p>Got it your email Shambo.</p>',NULL,0,0,NULL,'2024-11-27 09:25:41','2024-11-27 09:25:41'),(161,NULL,50,'allmydata2see@tutamail.com,brickhouse17@runbox.com','dsantosa@lionroaring.us,lystsantosa@gmail.com','Global Chair','<p>Timothy and Alicia,</p><p>The Global Chair roles provide the following:</p><ol><li>To ensure the vision and direction from Office of Christ are executed through out the nation.</li><li>To pray for Chair of the nation and their family.</li><li>To ensure that each chair receive the direction from the Holy spirit that aligned with the direction of the Office of Christ.</li><li>To receive the revelation from the Holy Spirit regarding to the chair of each nation if there is some concern and issues.</li><li>To resolve any problems and issues including removal of the leaders (collaborate with the office of Christ. &nbsp;If the problem is bigger than it is your responsibility to take up to the office of Christ.&nbsp;</li><li>To work with the chair for the approval of their leaders or governance board.</li><li>To share and understand in detail of Lion Roaring Business Plan and strategy..</li><li>To leverage Lion Roaring Digital Network (LRDNet 1.0) and solicit ideas for LRDNet 2.0 for improvement.</li></ol><p>This is what I can think right now.. Don\'t forget to read and execute the roles of the office of Christ in the business plan. &nbsp;It is important so that there is no confusion. &nbsp;I will include this role in the business plan later. &nbsp;The office of Christ will rotate yearly or every 2 years or when the Holy Spirit directed to do. &nbsp;Otherwise it will stay. &nbsp;The goal is the raise up the young leaders. &nbsp;Since we only operate 7 years, I don\'t see any changes in the leadership roles. You can include in the spreadsheet. &nbsp;You can add Global Chair of Lion Roaring Governance Board.</p><p>Have wonderful weekend and blessing.</p><p>Daud</p>',NULL,0,0,NULL,'2024-11-30 06:58:15','2024-11-30 06:58:15'),(168,NULL,107,'masumali9136@lionroaring.us',NULL,'Test New email updated','<p>hello</p>',NULL,0,0,NULL,'2024-12-02 08:54:34','2024-12-02 08:54:34'),(169,NULL,107,'swarnadwipnath4718@lionroaring.us',NULL,'test mail','<p>hiii</p>',NULL,0,0,NULL,'2024-12-02 09:22:39','2024-12-02 09:22:39'),(170,NULL,107,'swarnadwipnath4718@lionroaring.us',NULL,'test mail','<p>hiii</p>',NULL,0,0,NULL,'2024-12-02 09:22:47','2024-12-02 09:22:47'),(171,NULL,107,'swarnadwipnath4718@lionroaring.us',NULL,'test mail','<p>hiii</p>',NULL,0,0,NULL,'2024-12-02 09:24:11','2024-12-02 09:24:11'),(172,NULL,107,'swarnadwipnath4718@lionroaring.us',NULL,'test mail 3','<p>hiii 3</p>',NULL,0,0,NULL,'2024-12-02 09:24:40','2024-12-02 09:24:40'),(173,NULL,107,'swarnadwipnath4718@lionroaring.us',NULL,'test mail 3','<p>hiii 3</p>',NULL,0,0,NULL,'2024-12-02 09:30:31','2024-12-02 09:30:31'),(174,NULL,1,'shambochatterjee3979@lionroaring.us',NULL,'TEST','<p>TEST</p>',NULL,0,0,NULL,'2024-12-02 15:43:13','2024-12-02 15:43:13'),(175,NULL,107,'masumali9136@lionroaring.us',NULL,'Test ms22','<p>hii</p>',NULL,0,0,NULL,'2024-12-03 00:02:01','2024-12-03 00:02:01'),(176,NULL,90,'masum@excellisit.net',NULL,'Test live mail sub','<p>hello <strong>masum&nbsp;</strong></p>',NULL,0,0,NULL,'2024-12-03 08:15:21','2024-12-03 08:15:21'),(177,NULL,90,'masum@excellisit.net',NULL,'Test live mail sub','<p>hello <strong>masum&nbsp;</strong></p>',NULL,0,0,NULL,'2024-12-03 08:15:29','2024-12-03 08:15:29'),(178,NULL,107,'masum@excellisit.net',NULL,'mail sub','<p>hello <strong>masum</strong></p>',NULL,0,0,NULL,'2024-12-03 08:16:49','2024-12-03 08:16:49'),(179,NULL,107,'swarnadwip@excellisit.net',NULL,'mail sub','<p>hello <strong>swarna</strong></p>',NULL,0,0,NULL,'2024-12-03 08:17:42','2024-12-03 08:17:42'),(180,NULL,107,'swarnadwip@excellisit.net',NULL,'Test ms1',