2:23:09'),(214,209,107,'mas12345@gmail.com,appui@test.com',NULL,'This is test Subject','test2',NULL,0,0,NULL,'2024-12-11 02:25:31','2024-12-11 02:25:31'),(221,218,107,'mas12345@gmail.com',NULL,'This is test Subject','test',NULL,0,0,NULL,'2024-12-11 09:12:19','2024-12-11 09:12:19'),(222,NULL,71,'ssubowo@protonmail.com',NULL,'Test','<p>Did you receive?</p>',NULL,0,0,NULL,'2024-12-14 10:30:39','2024-12-14 10:30:39'),(223,NULL,50,'sgm2010@comcast.net,lystsantosa@gmail.com,ifcm.bangalore@gmail.com,Martin@Kingdom-Talents.com,brickhouse17@runbox.com,allmydata2see@tutamail.com,Pablochia@hotmail.com,adrychia@hotmail.com',NULL,'Met with Pastor John Anosike in Capetown, South Africa','<blockquote><p>Dear Office of Christ,</p><p>I want to share our meeting with the bond servant of Christ Pastor John Anosike on Monday, December 9, 2024.&nbsp; This was our primary reason to travel to Cape Town as the Lord directed Ps. Dirlene to connect with him and we followed the Lord\'s direction.&nbsp; When we finally received the email from his office on Monday morning indicating that our request to meet with him personally was granted, we were so excited.&nbsp; We were allocated for 10 minutes to see him at his office and we ended up with 20 minutes at his office.&nbsp; Although so many people were waiting for their appointment, the Lord truly gave us a big favor.&nbsp; His appointments time with people were from 2PM-4PM and we were the first to meet him as our time for meeting him was 2PM.&nbsp; The timing alone was the first indication that the Lord orchestrated the timing of the meeting.&nbsp;&nbsp;</p><p>When we met him, Pastor Dirlene gave the opening remark why we were in Cape Town to connect with him.&nbsp; We gave him our Lion Roaring flag and 7 pages of slides to summarize the Lion Roaring\'s structure and vision.&nbsp; &nbsp;As soon as he laid his hand on our Lion Roaring slides and flag, he told us that the Lord gave him the download and he will share with us later. He kept the Lion Roaring flag and the slides presentation.&nbsp; He could see right through each one of us and he said \"purity heart\" over to us.&nbsp; This was big for us when we heard what he said about us.&nbsp; He prayed and blessed us and told us that he will cover us before we left.&nbsp; &nbsp;He told us that he wants us to meet him personally in April 2025 as his top priority when he comes to the US to discuss further. He instructed his assistant to get our information so the assistant can follow up with us.&nbsp; He is very powerful man of God in the spirit realm.</p><p>He knew everything about us in the spirit, he has been waiting for us.<br><br>Praise the Lord. Only God orchestrated everything. &nbsp;He destroyed all the principalities in all nation during the Roar for the Nation conference through all the flags. &nbsp;It was incredible scene that I have never seen before. &nbsp;December is the month of alignment. &nbsp;This is the month &nbsp;that Lion Roaring aligned with him. &nbsp;We are completely align with the Father\'s will.<br><br>Unfortunately, on the way back, there was chaos in the plane when we landed in Addis Ababa.&nbsp; The flight was delayed causing passengers to panic not being able to catch the connecting flight.&nbsp; In the midst of the chaos, I forgot my camera bag. I left it in the plane including my laptop. &nbsp;I can\'t go back because it was late to reach to our connecting flight to US. &nbsp;I let it go and let God take care of it. &nbsp;Please pray for God\'s miracle to bring my bag to me.&nbsp;<br><br>Overall it was transformational of our spiritual journey and we were blessed to be able to align to Papa John Anosike (as they call him). &nbsp;God gives us grace to be able to connect with him and become his top priority.<br><br>Thank you for your prayers and intercession for Lion Roaring. &nbsp;We will experience change before the end of this year and in 2025.<br><br>We need to start accessing realms. &nbsp;See you in the realms everyone.<br><br>Note:&nbsp; If Ps Dirlene wants to add anything, please feel free to fill the missing gap.</p><p>Note: if you want to correspond via this email, please login in Lion Roaring email otherwise, you will not be to respond it.</p><p>Our email is created for Lion Roaring email environment. Just like google, yahoo.&nbsp;</p><p><br>Blessing,</p></blockquote><blockquote><p>Daud</p></blockquote>',NULL,0,0,NULL,'2024-12-14 10:33:18','2024-12-14 10:33:18'),(224,NULL,50,'dsantosa@lionroaring.us',NULL,'Met with Pastor John Anosike in Capetown, South Africa','<p><br>&nbsp;</p><p>From: Daud Santosa - dsantosa@lionroaring.us</p><p>TO: sgm2010@comcast.net,lystsantosa@gmail.com,ifcm.bangalore@gmail.com,Martin@Kingdom-Talents.com,brickhouse17@runbox.com,allmydata2see@tutamail.com,Pablochia@hotmail.com,adrychia@hotmail.com</p><p>Date: 14/12/2024 10:33 AM</p><blockquote><p>Dear Office of Christ,</p><p>I want to share our meeting with the bond servant of Christ Pastor John Anosike on Monday, December 9, 2024.&nbsp; This was our primary reason to travel to Cape Town as the Lord directed Ps. Dirlene to connect with him and we followed the Lord\'s direction.&nbsp; When we finally received the email from his office on Monday morning indicating that our request to meet with him personally was granted, we were so excited.&nbsp; We were allocated for 10 minutes to see him at his office and we ended up with 20 minutes at his office.&nbsp; Although so many people were waiting for their appointment, the Lord truly gave us a big favor.&nbsp; His appointments time with people were from 2PM-4PM and we were the first to meet him as our time for meeting him was 2PM.&nbsp; The timing alone was the first indication that the Lord orchestrated the timing of the meeting.&nbsp;&nbsp;</p><p>When we met him, Pastor Dirlene gave the opening remark why we were in Cape Town to connect with him.&nbsp; We gave him our Lion Roaring flag and 7 pages of slides to summarize the Lion Roaring\'s structure and vis