com','lystsantosa@gmail.com','Planning for Governance Board\'s meeting','<p>All,</p><p>We need to have a zoom meeting to plan for the works to be done for this 1st quarter 2025. &nbsp;Based on what Daud went over on December 29th, here are the works that we will need to start working on:</p><ul><li>1. Finance: Business Model for Fashionwear, Honey, Innovation implementation, restoration. - Lystia and Jasmine.<br>2. Forms development: Application Submission form for grants - Irene<br>3. Lion Roaring Web development: Sanny Subowo. Completion of LRDEnet 1.0, Mobile App iPhone and android.</li></ul><p>I have listed some of the tasks that we need to complete before we meet with Ps Anosike in April. &nbsp;The reason we want to have it completed before we meet is because they might be asking what we have developed and completed. We would want to show him the detail strategy (which we have), the structures, written manual policy &amp; procedures for the Lion Roaring PMA. &nbsp;We anticipate that they want to see our Lion Roaring PMA, Trust and even the manuals.</p><p>So we will be busy this quarter to focus in preparation to meet with him.</p><p>We need to brainstorm and re-visit what I have sent months ago about the draft of some manuals that we can start.</p><p>So - will everyone be available on Thursday, January 9th - 8PM for the zoom meeting?</p><p>Please let me know and we will set up the zoom.</p><p>Thanks.</p><p>Lystia</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>&nbsp;</li><li><br>&nbsp;</li></ul>',NULL,0,0,NULL,'2025-01-03 14:48:48','2025-01-03 14:48:48'),(273,272,50,'jgohgp@protonmail.com,dsantosa@lionroaring.us,ssubowo@protonmail.com,lizchirwa@yahoo.com,irenesubowo@gmail.com,bobh3@protonmail.com,lystsantosa@gmail.com',NULL,'Planning for Governance Board\'s meeting','<p>I am good meeting on thursday. &nbsp;I will propose to have every other week meeting to update the status as well. &nbsp;</p>',NULL,0,0,NULL,'2025-01-03 15:22:30','2025-01-03 15:22:30'),(274,269,71,'jgohgp