 15:26:58','2025-01-06 15:26:58'),(292,NULL,41,'jgohgp@protonmail.com,Yanjun2005@gmail.com,lizchirwa@yahoo.com,irenesubowo@gmail.com,sillahgoodnews@gmail.com,ssubowo@protonmail.com,dsantosa@lionroaring.us,esmansaray@gmail.com,bobh3@protonmail.com','lystsantosa@gmail.com','Ps Dirlene\'s teaching schedule for this month','<p>All,</p><p>I hope by now everyone has finished listening to Ps Dirlene\'s teaching on Sunday (1/5/25). &nbsp;If you haven\'t listened, please take time to listen and catch up because as a group, we will want to join the rest of her teaching (she mentioned that she has 40 slides or more that she will start teaching this month). There were many points that is connected to where the Lion Roaring is going in 2025. &nbsp;It is very important for each one of us to comprehend what the Lord has taught us this far and how He wants us to continue to move to the place where He is taking us for the Lion Roaring Implementation this year.</p><p>First and foremost important from her points is that Grace International (GI) and JMK/Lion Roaring is now aligned to what God has given us in LR. &nbsp;This was accomplished when the 3 of us went to South Africa to meet with Pastor Anosike. &nbsp;Now we know that the Lord brought us to SA so that we are aligning to where God wants to take us. &nbsp;And Papa John Anosike has adopted us and opening the path for us in the spiritual realm. His mandate is bigger as he is doing the Kingdom\'s works with all the nations. &nbsp;And we are a part (LR) of what God mandated to us. &nbsp;So this will be our focus in 2025 to plug in to his ministry to the extend what God is showing Ps Dirlene (as the head of Lion Roaring) and us as the members.</p><p>2nd point from her teaching that we need to fully comprehend is that we are in the era of Ecclesia and not the church. &nbsp;The difference is ecclesia is more of the kingdom and doing the function of the 5 fold ministries. &nbsp;The remnant/ecclesia is supposed to produce fruit and bring forth the fruit for the kingdom. &nbsp;So we are not just attending church, listening to sermon and doing our individual life. &nbsp;</p><p>In ecclesia, we are aligning and associating with nations and group of people that has the same mandate God has given. &nbsp;In aligning with these group of people, the expectation is that we are bringing something to the group (our skills, talents, resources, others -spiritual gifts) and it will be the other group expectation too to bring something what they have. &nbsp;This is how God will work through the alignment and association with the same minded and mandated Kingdom work. &nbsp;God will unite us together and everything will be based on God\'s will and purpose. &nbsp;And God is going to teach everything what we need to know in order to be able to be part of the group.&nbsp;</p><p>So - what\'s next for our group in order to be equipped and to shift to the Kingdom works through Lion Roaring:</p><ol><li>We will follow Ps Dirlene\'s teaching (she has a bible study every Tuesday) and Sunday service. &nbsp;If we can\'t join Tuesday bible study, i will ask for the recording so that we do not miss her teaching from the slides that she mentioned on Sunday</li><li>For ladies\' bible study on 2nd Tuesday of the month, she will continue teaching but anyone is welcomed to come since it is no longer specifically for the ladies but she continues teaching with her revelation. &nbsp;So for the men in this group, please join as well</li><li>For the rest of the month, we will join Ps Dirlene\'s Sunday teaching. &nbsp;As we have learned, this year focus will be implementation of LR and doing back ground works that needs to be completed in preparation for the meeting with Ps Anosike in April. &nbsp;Much works have been completed but we still have lots of work to do. &nbsp;</li><li>We will focus on narrow path and specific to the Lion Roaring mandate and vision now as we have been directed to move higher to the realms and we need to be equipped to take what God has reserved for us in order to be manifested in natural.</li></ol><p>Please get familiar with login to lion roaring website this year.</p><p>Bob has done a tremendous works and he has done so excellent in the education module to take the slides from the original teaching and make it so user friendly with points, questions, what we learn and summary for others to learn as bible study materials or even for us to revisit what God has taught us. Check his works if you have not done so and you will agree with me that he has dedicated his gifts for the Lion Roaring as one of the 5 fold ministries in teaching. &nbsp;BIG THANK YOU to you Bob for your faithfulness.</p><p>See you all Sunday - moving forward and marching as God\'s army (that\'s what ps Steven also mentioned last night - we are the army and we are at war).</p><p>blessings,</p><p>lystia&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>',NULL,0,0,NULL,'2025-01-07 12:13:03','2025-01-07 12:13:03'),(293,NULL,41,'sgm2010@comcast.net',NULL,'Ps Dirlene\'s teaching schedule for this month','<p>Ps Dirlene,</p><p>FYI - I just sent the email below to our members</p><p>lystia</p><p>From: Lystia Santosa - lystsantosa@gmail.com</p><p>TO: jgohgp@protonmail.com,Yanjun2005@gmail.com,lizchirwa@yahoo.com,irenesubowo@gmail.com,sillahgoodnews@gmail.com,ssubowo@protonmail.com,dsantosa@lionroaring.us,esmansaray@gmail.com,bobh3@protonmail.com</p><p>CC: lystsantosa@gmail.com</p><p>Date: 01/07/2025 12:13 PM</p><p>All,</p><p>I hope by now everyone has finished listening to Ps Dirlene\'s teaching on Sunday (1/5/25). &nbsp;If you haven\'t listened, please take time to listen and catch up because as a group, we will want to join the rest of her teaching (she mentioned that she has 40 slides or more that she will start teaching this month). There were many points that is connected to where the Lion Roaring is going in 2025. &nbsp;It is very important for each one of us to comprehend what the Lord has taught us this far and how He wan