 DC)<br>+13092053325,,87159623014#,,,,*713249# US</p><p>---</p><p>Dial by your location<br>‚Ä¢ +1 301 715 8592 US (Washington DC)<br>‚Ä¢ +1 309 205 3325 US<br>‚Ä¢ +1 312 626 6799 US (Chicago)<br>‚Ä¢ +1 646 931 3860 US<br>‚Ä¢ +1 929 436 2866 US (New York)<br>‚Ä¢ +1 305 224 1968 US<br>‚Ä¢ +1 689 278 1000 US<br>‚Ä¢ +1 719 359 4580 US<br>‚Ä¢ +1 253 205 0468 US<br>‚Ä¢ +1 253 215 8782 US (Tacoma)<br>‚Ä¢ +1 346 248 7799 US (Houston)<br>‚Ä¢ +1 360 209 5623 US<br>‚Ä¢ +1 386 347 5053 US<br>‚Ä¢ +1 507 473 4847 US<br>‚Ä¢ +1 564 217 2000 US<br>‚Ä¢ +1 669 444 9171 US<br>‚Ä¢ +1 669 900 6833 US (San Jose)</p><p>Meeting ID: 871 5962 3014<br>Passcode: 713249</p><p>Find your local number: https://us02web.zoom.us/u/kdYNnbse2f</p><p>&nbsp;</p>',NULL,0,0,NULL,'2025-01-07 17:06:38','2025-01-07 17:06:38'),(300,NULL,50,'allmydata2see@tutamail.com,brickhouse17@runbox.com,GPTFMinistries@proton.me,ifcm.bangalore@gmail.com,Martin@Kingdom-Talents.com','sgm2010@comcast.net','Planning for Governance Board\'s meeting','<p>All,</p><p>This is the email from Lystia to our member for your information. &nbsp;There are a lot of changes last year. &nbsp;This year is going to busy year. &nbsp;We will inform you. &nbsp;You can take a look at the strategy from one of the business man that I met in South Africa in the strategy. &nbsp;He gave it to Lion Roaring to implement them. &nbsp;He will also will produce in some of those stratgies. &nbsp;This is very exciting time. &nbsp;Praise the Lord.</p><p>Thank you,</p><p>Daud<br>&nbsp;</p><p>From: Lystia Santosa - lystsantosa@gmail.com</p><p>TO: jgohgp@protonmail.com,dsantosa@lionroaring.us,ssubowo@protonmail.com,lizchirwa@yahoo.com,irenesubowo@gmail.com,bobh3@protonmail.com</p><p>CC: lystsantosa@gmail.com</p><p>Date: 01/03/2025 02:48 PM</p><p>All,</p><p>We need to have a zoom meeting to plan for the works to be done for this 1st quarter 2025. &nbsp;Based on what Daud went over on December 29th, here are the works that we will need to start working on:</p><ul><li>1. Finance: Business Model for Fashionwear, Honey, Innovation implementation, restoration. - Lystia and Jasmine.<br>2. Forms development: Application Submission form for grants - Irene<br>3. Lion Roaring Web development: Sanny Subowo. Completion of LRDEnet 1.0, Mobile App iPhone and android.</li></ul><p>I have listed some of the tasks that we need to complete before we meet with Ps Anosike in April. &nbsp;The reason we want to have it completed before we meet is because they might be asking what we have developed and completed. We would want to show him the detail strategy (which we have), the structures, written manual policy &amp; procedures for the Lion Roaring PMA. &nbsp;We anticipate that they want to see our Lion Roaring PMA, Trust and even the manuals.</p><p>So we will be busy this quarter to focus in preparation to meet with him.</p><p>We need to brainstorm and re-visit what I have sent months ago about the draft of some manuals that we can start.</p><p>So - will everyone be available on Thursday, January 9th - 8PM for the zoom meeting?</p><p>Please let me know and we will set up the zoom.</p><p>Thanks.</p><p>Lystia</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>&nbsp;</li></ul><p>&nbsp;</p>',NULL,0,0,NULL,'2025-01-07 17:53:42','2025-01-07 17:53:42'),(301,NULL,50,'bobh3@protonmail.com',NULL,'Teaching','<p>Bob,</p><p>You can choose any topic you want to work on. &nbsp;You can ask the Holy Spirit what would be the next topic. &nbsp;You can practice to hear His voice. &nbsp;</p><p>Thank you so much for your commitment and loyalty.</p><p>Daud.</p>',NULL,0,0,NULL,'2025-01-07 17:57:13','2025-01-07 17:57:13'),(302,NULL,50,'Pablochia@hotmail.com,adrychia@hotmail.com',NULL,'Planning for Governance Board\'s meeting','<p>Pastor Pablo and Pastor Adriana,</p><p>Este es el correo electr√≥nico de Lystia a nuestro miembro para su informaci√≥n. El a√±o pasado hubo muchos cambios. Este a√±o ser√° un a√±o muy ajetreado. Le informaremos. Puede echar un vistazo a la estrategia de uno de los hombres de negocios que conoc√≠ en Sud√°frica. Se la dio a Lion Roaring para que la implementara. Tambi√©n producir√° algunas de esas estrategias. Este es un momento muy emocionante. Alabado sea el Se√±or.</p><p>Blessings,</p><p>Daud</p><p><br>&nbsp;</p><p>From: Daud Santosa - dsantosa@lionroaring.us</p><p>TO: allmydata2see@tutamail.com,brickhouse17@runbox.com,GPTFMinistries@proton.me,ifcm.bangalore@gmail.com,Martin@Kingdom-Talents.com</p><p>CC: sgm2010@comcast.net</p><p>Date: 01/07/2025 05:53 PM</p><p>All,</p><p>This is the email from Lystia to our member for your information. &nbsp;There are a lot of changes last year. &nbsp;This year is going to busy year. &nbsp;We will inform you. &nbsp;You can take a look at the strategy from one of the business man that I met in South Africa in the strategy. &nbsp;He gave it to Lion Roaring to implement them. &nbsp;He will also will produce in some of those stratgies. &nbsp;This is very exciting time. &nbsp;Praise the Lord.</p><p>Thank you,</p><p>Daud<br>&nbsp;</p><p>From: Lystia Santosa - lystsantosa@gmail.com</p><p>TO: jgohgp@protonmail.com,dsantosa@lionroaring.us,ssubowo@protonmail.com,lizchirwa@yahoo.com,irenesubowo@gmail.com,bobh3@protonmail.com</p><p>CC: lystsantosa@gmail.com</p><p>Date: 01/03/2025 02:48 PM</p><p>All,</p><p>We need to have a zoom meeting to plan for the works to be done for this 1st quarter 2025. &nbsp;Based on what Daud went over on December 29th, here are the works that we will need to start working on:</p><ul><li>1. Finance: Business Model for Fashionwear, Honey, Innovation implementation, restoration. - Lystia and Jasmine.<br>2. Forms development: Application Submission form for grants - Irene<br>3. Lion Roaring Web development: Sanny Subowo. Completion of LRDEnet 1.0, Mobile App iPhone and android.</li></ul><p>I have listed some of the tasks that we need to complete before we meet with Ps Anosike in April. &nbsp;The reason we want to have it completed before we meet is because they might be asking what we have developed and completed. We would want to show him the detail strategy (which we have), the structures, written manual policy &amp; procedures for the Lion Roaring PMA. &nbsp;We anticipate that they want to see our Lion Roaring PMA, Trust and even the manuals.</p><p>So we will be busy this quarter to focus in preparation to meet with him.</p><p>We need to brainstorm and re-visit what I have sent months ago about the draft of some manuals that we can start.</p><p>So - will everyone be available on Thursday, January 9th - 8PM for the zoom meeting?</p><p>Please let me know and we will set up the zoom.</p><p>Thanks.</p><p>Lystia</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>&nbsp;</li></ul><p>&nbsp;</p><p><br>&nbsp;</p>',NULL,0,0,NULL,'2025-01-07 18:01:19','2025-01-07 18:01:19'),(303,NULL,50,'Pablochia@hotmail.com,adrychia@hotmail.com','sgm2010@comcast.net','Comprobando la colaboraci√≥n de Lion Roaring','<p>Estimado Pastor Pablo y Pastora Adriana, Feliz a√±o nuevo, solo quiero que sepan lo que el Se√±or nos ha estado hablando y conectando el a√±o pasado o desde que regresamos de Sud√°frica. Mi esposa ha enviado parte de la informaci√≥n a nuestro miembro y yo se la reenv√≠o a ustedes. Para reducir el tiempo, a partir de 2025 vamos a aprovechar este entorno de colaboraci√≥n de Lion Roaring para comunicar todo el material que se asocia con Lion Roaring. Nos hemos reunido con dos hombres de negocios de Sud√°frica: apicultor y fabricante de prendas de vestir. Estos hombres nos ayudar√°n a crear la miel Lion Roaring (miel de tipo Acasia) y sus otros productos y a crear la marca de ropa Lion Roaring. Compartir√© la estrategia de la ropa m√°s adelante. Mientras tanto, pueden ver al apicultor de Bulgaria. √âl recibi√≥ la estrategia del Cielo. La publico en la estrategia, pueden revisarla y preguntarle al Se√±or qu√© √°rea pueden aportar para contribuir a sus ideas. Necesitamos prepararnos ahora, planeamos reunirnos con Papa John Anosike en abril. Todo se acelerar√° despu√©s de abril. Por favor, sigan orando por nosotros.</p><p>Que Dios les bendiga.</p><p>Lo mejor est√° por venir.</p><p>Daud.</p><p>English:</p><p>Dear Pastor Pablo and Pastor Adriana, Happy new year, I just want let you know what the Lord has been speaking to us and connecting us last year or since we came back from South Africa. &nbsp;My wife has sent some of the information to our member and I forward that to you. &nbsp;In &nbsp;order to reduce time, beginning 2025 we are going to leverage this Lion Roaring Collaboration environment to communicate all material that associate with Lion Roaring. &nbsp;We have met with two business men from South Africa: Bee Keeper and Garment Manufacturer. &nbsp;These men will help us to create Lion Roaring Honey (Acasia type of Honey) and its other products and to create Lion Roaring clothing brand. &nbsp;I will share the strategy of clothing later. &nbsp;In the mean time you can look at the bee Keeper Man from Bulgaria. &nbsp;he received the strategy from Heaven. I post it in the strategy, you can review it and ask the Lord what area that you can bring to contrinute to help his ideas. We need to prepare now, we plan to meet with Papa John Anosike in April. &nbsp;Everything will accelerate after april. Please contnue praying for us.</p><p>Blessings to you,</p><p>The best is yet to come.</p><p>Daud.</p>',NULL,0,0,NULL,'2025-01-07 18:13:36','2025-01-07 18:13:36'),(304,NULL,50,'lystsantosa@gmail.com',NULL,'Update of Lion Roaring','<p>Dear Office of Christ member, Happy new year, I just want let you know what the Lord has been speaking to us and connecting us last year or since we came back from South Africa. &nbsp;My wife has sent some of the information to our member and I forward that to you. &nbsp;In &nbsp;order to reduce time, beginning 2025 we are going to leverage this Lion Roaring Collaboration environment to communicate all materials that associate with Lion Roaring. &nbsp;We have met with two business men from South Africa: Bee Keeper and Garment Manufacturer. &nbsp;These men will help us to create Lion Roaring Honey (Acasia type of Honey) and its other products and to create Lion Roaring clothing brand. Ivan bee Keeper &nbsp;from Bulgaria, &nbsp;has received the strategy from Heaven. I post it in the strategy, you can review it and ask the Lord what area that you can help and contrinute supporting his ideas. We need to prepare now, we plan to meet with Papa John Anosike in April. &nbsp;Everything will accelerate after april. Please contnue praying for us.</p><p>Blessings to you,</p><p>The best is yet to come.</p><p>Daud.</p>',NULL,0,0,NULL,'2025-01-07 18:19:21','2025-01-07 18:19:21'),(306,272,62,'jgohgp@protonmail.com,dsantosa@lionroaring.us,ssubowo@protonmail.com,lizchirwa@yahoo.com,irenesubowo@gmail.com,bobh3@protonmail.com,lystsantosa@gmail.com',NULL,'Planning for Governance Board\'s meeting','<p>See you all tomorrow.</p>',NULL,0,0,NULL,'2025-01-08 11:24:52','2025-01-08 11:24:52'),(307,292,62,'jgohgp@protonmail.com,Yanjun2005@gmail.com,lizchirwa@yahoo.com,irenesubowo@gmail.com,sillahgoodnews@gmail.com,ssubowo@protonmail.com,dsantosa@lionroaring.us,esmansaray@gmail.com,bobh3@protonmail.com,lystsantosa@gmail.com',NULL,'Ps Dirlene\'s teaching schedule for this month','<p>BTW, we need Ps Dirlene\'s profile on LR website. Is she working on it?</p><p>Thanks,<br>Irene</p><p>&nbsp;</p>',NULL,0,0,NULL,'2025-01-08 11:39:23','2025-01-08 11:39:23'),(308,301,71,'bobh3@protonmail.com,dsantosa@lionroaring.us',NULL,'Teaching','<p>ok thank you Daud.</p><p>&nbsp;</p><p>Bob</p>',NULL,0,0,NULL,'2025-01-08 14:24:18','2025-01-08 14:24:18'),(309,NULL,71,'dsantosa@lionroaring.us',NULL,'Bee Strategy','<p>Hi Daud:</p><p>I was impressed by the strategy from Ivan. A minor point-he suggests glass for water storage but said cans for factory food items. Personally, I would recommend glass here too as its cleaner.</p><p>But all in all, its looks great.&nbsp;</p><p>Bob</p>',NULL,0,0,NULL,'2025-01-08 14:35:48','2025-01