INSERT INTO `services` VALUES (1,2,'details/cZ0G3rZAnfyDECHpSYfl3Rko9tChOJWRyIigGa7L.jpg','<p>These pictures describes many different focus areas that helping the villagers, communities to restore the condition of their living.</p><p>PRISON LIGHTER: Our focus is to rebuild those affected by Crime &amp; Incarceration using the supernatural transformation by God and become physically and spiritually healthy. What follows is education through Lion Roaring Community of interest groups. Many of us have made mistakes that are life altering; many deserve a second chance to rebuild one‚Äôs character and become productive members of society. Our goal is to help people achieve that goal, so those individuals serve as a role model for others in similar predicaments and are able to give back to humanity and demonstrate the forgiving nature of God.</p>','2024-03-26 03:43:39','2024-04-19 05:04:01'),(2,2,'details/Wkc4h48cV9MigVX1DtrTAtE9GHQfnGw4bGuS6G0V.jpg','<p>HOMELESS: Our focus is to see individuals and families set free from the addictions of homelessness, thus becoming transformed by God to become physically and spiritually healthy. Education then follows through Lion Roaring community of interest groups. Employment in areas such as field work and the sewing industry not only provides income, skills, and development of self-worth, but it also helps take the focus off addiction. This also allows individuals to give back to the community, train others, and develop a thankful heart for the Lord‚Äôs provisions.</p><p>CHILDREN: Our focus is to feed, clothe, shelter, and educate children by raising them in the Lion Roaring habitation, &nbsp;education and to train them through the Seven Lion Roaring community of interest groups. We assist with the provision for the necessities of life and ministry. However, even more importantly, our children provide social gatherings, ministry, and celebrations, along with mentoring, giving children a sense of family. Our work in demonstrating the joy of the Lord will help ensure the success of these children and future generations.<br>Famine and</p>','2024-03-26 03:43:39','2024-06-23 19:27:56'),(3,2,'details/9sMWzoEfrYdGu6pDzKeuRx5Li8VEAZaI6sRvGBGb.jpg','<p>MALNUTRITION: Our focus is to prevent hunger and malnutrition by providing food and by promoting farming methods to achieve sustainability for a hunger-free community. Education via the knowledge of how to produce abundantly healthy food, coupled with employment opportunities, will go a long way to eliminating food shortages and undernourishment.</p><p>CHILD AND DRUG ABUSE: Our focus is to protect children from abuse and neglect. Our goal is to engage families to safely parent their children by providing collaborative intervention services to child abuse victims. Training in prevention and recognition of the signs of child or drug abuse are the first steps to tackling this issue. Thereafter, coaching and community support on how to help children and others heal from abuse are necessary components to recovery.</p>','2024-03-26 03:43:39','2024-04-19 05:04:01'),(4,2,'details/ZkCjLeN27vUrwVIxldObFU7Lm8ze1gdJqO5dnf9A.jpg','<p>HEALTH CARE/MEDICAL: Our focus is to heal underserved people and train local practitioners in remote or broken communities, villages, and cities. Climate, poor living conditions, the lack of health care along with frequent cases of respiratory tract infection, diarrhea, Malaria and Dengue all contribute to ongoing challenges in many isolated areas. By providing medical care and training, our goal is to help mitigate these problems.</p>','2024-03-26 03:43:39','2024-04-19 05:04:01'),(6,2,'details/0jb0CksXlG7KMcvZXiRFDS9AfJ7mOTmVSzYWfry3.jpg','<p>SINGLE PARENTS: Our focus is to empower single parents to lead successful families and educate them to build strong communities through Lion Roaring habitation. With the ministry‚Äôs donation of sewing machines (24 in total to date), for example, single or widowed women are now able to earn an income and provide for the needs of their family. Education in the ways of the Lord and skill development are also components of this ministry that helps facilitate life altering opportunities for many.</p>','2024-03-26 03:43:39','2024-04-19 05:04:01');
