INSERT INTO `testimonials` VALUES (4,'Pastor Pablo and Adriana Chia','Argentina','<p><strong>Dear Pastor David and Lystia Santosa, dear brothers of Lion Roaring. We send you a great and warm brotherly hug in our beloved Lord Jesus, who is pleased to connect us, and not with just any connection, but an eternal one for his purposes and plans in our city and nation. We want to bear witness to everything that the Father has done in this time, which is a lot and Supernatural!! \"Many times we think that God is taking a while to answer us, but in reality He is preparing us for what is coming.\" And it is precisely what the Eternal planned and allowed on Wednesday, September 20, 2023, in the middle of an evangelistic campaign for children.</strong> <strong>That day, Claudio, one of the servants, went out to receive all the prophetic company that would be helping us evangelize. Something \"crazy\" happened... And Claudio felt a very strong voice that told him: \"That\'s the man\" (Claudio looked everywhere... who said that?? what man??)</strong> <strong>Immediately the Face of Pastor David appeared. He understood there that God had something in his hands... A day prepared by the Father where in seconds he allowed a very strong spiritual bond.</strong> <strong>Since without knowing each other, without having ever spoken before, God began to bring words through the mouth of Pastor David, and each word was nothing more than the promises of God for the territory, for our congregation and for an entire generation of children and young people that God will use to proclaim his kingdom.</strong> <strong>Encouragement and new strength came with each of Pastor David\'s words about Pastor Pablo. Oh, our hearts were beating strong! We could only say \"Thank you God! You do as you please; you have sent someone from another place to speak to us, to know that nothing has been in vain! Thank you God because your eyes are on this house!!!\" truly God is Sovereign. We cannot stop getting excited.</strong> <strong>The father put it in our hearts, 5 years ago, that He would use the church to restore the vile, the despised, and the rejected by others. We embraced that word and our hearts beat strongly to reach the generations of young people and children that we saw getting lost every day. God allowed us to find the Jes√∫s Rey Soberano Revival Center. It is in front of an old train station, a place where many young people go take drugs and get drunk. They are homeless and totally abandoned, and many of them are lost in crime. &nbsp;Children are living in sad realities. They are alone in their homes. They use the warehouses of the station to get their basic needs. They lack of affection. No one tells them about Jesus...</strong> <strong>We take the challenge and seize the territory for the Lord.&nbsp; God did not fail to send an answer. You Pastor, as we told you before, \"You are the answer to our prayers.</strong> <strong>We want to thank you for your support, trust and every planting for this place. With each seed, we have built a kitchen, a place where we have a space and comforts to be able to cook and to provide snacks and dinner to our children, adolescents and young people. The kitchen is equipped with pizza oven and some furniture. We also bought new chairs, instruments for the altar, and a gazebo so we could preach in the streets. Part of those seeds have also been used to build cement floors at the entrance to the temple.&nbsp; At the Christmas evangelistic event, where we were able to provide food and toys to a large number of children, to whom we were able to talk and introduce them to Jesus. God is doing amazing things!</strong></p>','testimonials/xEhIQVd68fYEUmdWzA0f5ybp2BYDiUZp1VDjiKQC.jpg','2024-03-26 13:08:27','2024-08-20 07:42:14'),(5,'Paul and Rebecca Devakumar','Bengaluru-560043,  INDIA','<p>India for Christ Ministries (IFCM)&nbsp;</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-style: normal; font-variant-caps: normal; font-stretch: normal; font-size: 13px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-size-adjust: none; font-kerning: auto; font-variant-alternates: normal; font-variant-ligatures: normal; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-position: normal; font-variant-emoji: normal; font-feature-settings: normal; font-optical-sizing: auto; font-variation-settings: normal;\">We&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>continue&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>to&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>receive&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>encouraging&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>reports&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>of God‚Äôs leading and presence from outreach centers in different parts of our country. Even though the present situation is very tough and very difficult to present the gospel, God has been on our side and enabled&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>us&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>to&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>move&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>forward.&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>There&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>are&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>so&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>many instances&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>of&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>God‚Äôs&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>grace&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>and&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>mercy&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>being showered&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>upon&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>people&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>as&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>we&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>pray&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>and&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>ask&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>the Lord.&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>Our&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>focus&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>has&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>been&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>Evangelism,&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>Follow-up, Discipleship and Church planting ministry.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-style: normal; font-variant-caps: normal; font-stretch: normal; font-size: 13px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-size-adjust: none; font-kerning: auto; font-variant-alternates: normal; font-variant-ligatures: normal; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-position: normal; font-variant-emoji: normal; font-feature-settings: normal; font-optical-sizing: auto; font-variation-settings: normal; min-height: 15px;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-style: normal; font-variant-caps: normal; font-stretch: normal; font-size: 13px; line-height: normal; font-family: &quot;Helvetica Neue&quot;; font-size-adjust: none; font-kerning: auto; font-variant-alternates: normal; font-variant-ligatures: normal; font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-position: normal; font-variant-emoji: normal; font-feature-settings: normal; font-optical-sizing: auto; font-variation-settings: normal;\">The&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>work&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>among&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>the children&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>at&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>our&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>outreach centers&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>continue&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>to progress and we praise God for&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>all&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>that&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>has&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>been accomplished.&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>The&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>children are growing beautifully. Thank&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>you&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>for&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>your encouraging&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>letters,&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>e-mails&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>and&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>for&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>your&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>prayers and&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>support.&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>We&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>are&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>grateful&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>to&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>you&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>for&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>your partnership with us and for standing with us in the ministry&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>in building&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>God‚Äôs&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>Kingdom.&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>Your&nbsp;<span style=\"direction: ltr; unicode-bidi: bidi-override\"> </span>rewards are in eternity. May God bless you abundantly!&nbsp;</p>','testimonials/0Yc8vHyFtngejfoHR7cNDNdOjLykc1TfxlS5b7Ex.jpg','2024-10-31 08:00:21','2024-10-31 08:00:21');
